-- Dumping data for table opus.about_us: ~4 rows (approximately)
INSERT INTO `about_us` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'About us', '<p><img style="width: 496.771px; float: left; height: 331.359px;" src="data:image/jpeg;base64," data-filename="img-4.jpg" class="note-float-left m-4" title=""></p><p><span style="color: rgb(66, 66, 66); font-size: 1rem;"><br></span></p><p><span style="color: rgb(66, 66, 66); font-size: 1rem;">At Opus Academy, we pride ourselves on the academic and personal success of our students. Our highly trained team of experts work towards empowering young minds to reach their potential while providing them with the knowledge and tools necessary to meet their goals.</span><br></p><p><font color="#424242">As Greater Vancouver\'s premier after-school enrichment provider, we offer a range of rewarding learning experiences and diverse coursework. From our comprehensive educational counselling packages to our subject-specific class offerings, we assist in developing our student\'s intellectual curiosity and breadth of knowledge. Our students enter their post-secondary education equipped with the confidence and skills necessary for a promising future.</font></p><p><font color="#424242">A childs education is one of the most important investments a parent can make, and we recognize the importance out-of-school mentorship and guidance has on the developing mind. We look forward to sharing our passion for education, and to help set your child on the path towards lifelong success.<br></font></p><p><br></p>', 0, '2022-05-06 10:40:35', '2022-07-12 06:19:05'),
	(2, 'Section II', 'Mission', '<p><img style="width: 508.566px; float: right; height: 339.221px;" src="data:image/jpeg;base64," data-filename="img-5.jpg" class="note-float-right m-4" title=""></p><p><span style="color: rgb(66, 66, 66); font-size: 1rem;"><br></span></p><p><font color="#424242">Through specialized education programs geared towards accelerating individual success, our mission is to bring out the best in every student. Our committed instructors help young learners build the confidence they need, while empowering them to become our worlds future leaders.&nbsp;</font></p><p><font color="#424242">Helping your family navigate the rigorous and complex path of private school applications and university admissions is of utmost importance to us. With personalized counselling services, we will help you find the best institution based on your childs unique strengths and guide them into the exciting next phase of life.&nbsp;</font></p>', 0, '2022-05-06 11:01:30', '2022-07-12 06:19:55'),
	(3, 'Section III', 'Vission & Philosophy', '<p><img style="width: 496.771px; float: left; height: 331.359px;" src="data:image/jpeg;base64," data-filename="img-6.jpg" class="note-float-left m-4" title=""></p><p><span style="color: rgb(49, 48, 48); font-size: 1rem;"><br></span></p><p><font color="#313030">Our vision at Opus Academy is to be prepare students as they venture into the world of personal and academic success. Witnessing a global network of Opus alumni graduating from the worlds most elite post-secondary institutions, while armed with the early training we offer in communication, leadership, and critical thinking skills, drives our dedicated staff each and every day.&nbsp;</font></p><p><font color="#313030">We believe strength and character lies in the quality and commitment of our team, whose professionalism and genuine love of learning continues to champion shared values of trust, accountability, support, and determination. We believe in the motto that a lifelong love of learning will always lead to a bright and prosperous future.</font></p>', 0, '2022-05-06 11:02:07', '2022-07-12 06:21:20'),
	(4, 'Section IV', 'Core Values', '<span open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);">We believe that the strength and character of our company lies in the quality, spirit, and commitment of our people. The dedication, professionalism, and team-focused attitudes of our instructors, administrators and management team are the basis of our success.</span><br open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);"><br open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);"><span open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);">Each of us commits to excel at what we do and abides by our core values of Trust, Accountability, Support, Truth, and Effort.</span><br open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);"><br open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);"><span open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48);">Our core philosophy is that a lifelong love of learning will lead to bright futures for our students.</span><br>', 1, '2022-05-06 11:02:13', '2022-07-12 06:22:48');

