-- Dumping data for table opus.academic_enrichment: ~2 rows (approximately)
INSERT INTO `academic_enrichment` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Why learn to debate?', '<p><span open="" sans",="" sans-serif;"=""><font color="#424242">At Opus, we have developed a unique English course that complements and enriches the high school curriculum, giving your child a step-up in grasping the English language at an intellectual level. Our Critical Reading and Writing courses progress over four years as students explore and master English language and literature</font></span></p><p><span open="" sans",="" sans-serif;"=""><font color="#424242"><br></font></span></p><p><span open="" sans",="" sans-serif;"=""><img src="data:image/jpeg;base64," data-filename="crw.jpg" class="m-4" alt="" title="" style="float: right; width: 763.535px; height: 509.309px;"></span></p><h5><font color="#424242">CRW Level 1 Introduction to Academic Writing and Literary Analysis:&nbsp;</font></h5><p><font color="#424242">Students learn about the basic analysis and critique of literary works, and learn how to write a successful academic essay.</font></p><div><p></p><h5><font color="#424242">CRW Level 2 Genres of Communication:</font></h5><p><font color="#424242">In this course, students learn elements of creative writing, and delve deeply into the study of and argumentation</font></p><h5><font color="#424242">CRW Level 3 Literary Analysis and Exposition:</font></h5><p><font color="#424242">In this course, students will gain a broad, detailed overview of the history of English literature and literary criticism</font></p><h5><font color="#424242">CRW Level 4 Advanced Analysis &amp; Exposition:</font></h5><p><span open="" sans",="" sans-serif;"=""><font color="#424242"></font></span></p><p><font color="#424242">This course probes further into advanced literary analysis, with challenging classic texts,preparing</font></p><p><font color="#424242">students for what to expect from the AP course that follows the CRW units.</font></p></div>', 0, '2022-06-03 00:00:00', '2022-07-08 08:01:55'),
	(2, 'Section II', 'Academic Subject Tutoring', '<h5 class="content" style="font-family: Raleway, sans-serif; position: relative; padding: 30px; background: rgba(41, 23, 110, 0.86); border-radius: 4px;"><span segoe="" ui";"=""><font color="#efefef">We provide academic enrichment in all core subjects. Our goal is for students to master the material and achieve academic success no matter their starting point. Our teachers are subject area experts and are dedicated to their students success. They teach not only subject content, but also the strategies and skills that enable students to meet their educational goals with ease.</font></span><font color="#ffffff"></font></h5><div class="row mt-5" open="" sans",="" sans-serif;"="" style="margin-right: calc(-0.5 * var(--bs-gutter-x)); margin-left: calc(-0.5 * var(--bs-gutter-x)); --bs-gutter-x:1.5rem; --bs-gutter-y:0;"><div class="col-xl-3 col-lg-6 col-sm-12" style="width: 330px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242">English</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Advanced Placement (AP) Level: English Literature and Composition, English Language and Composition</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">High School: English Language, Literature Studies, and Communications</font></li></ul></div><div class="col-xl-3 col-lg-6 col-sm-12" style="width: 330px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242">Science</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Advanced Placement (AP): Biology, Physics, Chemistry, Environmental Science</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">High School: Biology, Physics, Chemistry, Earth Sciences</font></li></ul></div><div class="col-xl-3 col-lg-6 col-sm-12" style="width: 330px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242">Social Studies, History &amp; Social Sciences</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Advanced Placement (AP): World History, European History, US History, Art History, Comparative Government and Politics, Human Geography</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">High School: Social Studies, Law</font></li></ul></div><div class="col-xl-3 col-lg-6 col-sm-12" style="width: 330px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242">Languages</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Advanced Placement (AP): French, Chinese, Japanese and others</font></li></ul></div></div>', 0, '2022-06-03 00:00:00', '2022-07-08 08:02:56');

