-- Dumping data for table opus.admission_counselling: ~5 rows (approximately)
INSERT INTO `admission_counselling` (`admission_id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Opus Admission Counselling', '<div><font color="#efefef">Opus Academy has helped numerous students navigate some of the most challenging aspects of their education. As mentors and role models, our teachers and counsellors work together to develop approaches aimed at establishing student success and potential. Our objective is assisting students to reach their educational and personal goals for a lifetime of success in college and beyond.</font></div><div><font color="#efefef"><br></font></div><div><font color="#efefef">We provide students with educational counselling&nbsp;services for admissions to private day/boarding schools, universities and graduate schools in the United States, Canada, the United Kingdom, and beyond.&nbsp;</font></div><div><br></div>', 0, '0000-00-00 00:00:00', '2022-07-12 06:30:34'),
	(2, 'Section II', 'Private School Admissions Counselling', '<div style="line-height: 19px;"><div style="line-height: 19px;"><div style=""><div><p><span segoe="" ui",="" roboto,="" "helvetica="" neue",="" arial,="" sans-serif,="" "apple="" color="" emoji",="" "segoe="" ui="" symbol",="" "noto="" emoji";="" font-size:="" 1rem;"=""><font color="#424242">Many successful graduates and alumni attribute their success to the head start they received in private school. All parents want what is best for their child, but with the rising popularity of private schools and their admissions requirements, the application process can be overwhelming.</font></span></p></div><div><font color="#424242">Opus Academy will help guide your family through the private school application process for students in K-12. Our team of counsellors, teachers, and administrators will help identify the list of schools to apply to based on a students needs and interests. We help plan, brainstorm, and edit application essays, as well as prepare students and parents for admissions interviews.</font><br></div><div><font color="#424242"><br></font></div><div><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Private Day Schools</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Boarding Schools</font></li></ul><p><font color="#424242"><br></font></p><p><font color="#424242">Standardized Test Preparation offered:</font></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">SSAT - Secondary School Admission Test</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ISEE - Independent School Entrance Examination</font></li></ul><p style="padding: 0.5rem 1rem;"><font color="#424242"><br></font></p><p><font color="#424242">We tailor the curriculum to the strengths and weaknesses of the individual student, making sure to cover all possible content and ensuring an improvement in the score.</font></p></div></div></div></div>', 0, '0000-00-00 00:00:00', '2022-07-12 06:30:05'),
	(3, 'Section III', 'University Admissions Counselling', '<h5><font color="#424242">The Need</font></h5><p><font color="#424242">Are you anxious about your childs success in the competitive US college application process?</font></p><p><font color="#424242">Let Opus guide you through a personalized strategic plan!</font></p><p><font color="#424242">Your childs higher education is one of the most important investments you will ever make. The right choice can save you money and emotional stress. The admissions process has grown more complex than ever - a plethora of university choices and intense competition for highly selective universities. With increasing cost of university education, it is crucial to choose a counsellor who will help guide your child in making the best decision for his or her university education.&nbsp;</font></p><p><font color="#424242">To be admitted into a highly selective college requires students to stand out from the rest. Opus Academy will help guide your child in making the best decisions regarding their university education.&nbsp;</font></p><h5><font color="#424242">Who We Are&nbsp; .. The Team Approach</font></h5><p><font color="#424242">Our admissions counsellors offer a wealth of knowledge, experience, and expertise to the university admissions process. Not only do we have a deep and objective understanding of many universities their offerings, the application form, and personal essays, but we also expertly understand the application process in general. Our counsellors stay in touch with current trends and spend much time touring campuses and talking with university counselling professionals and admission officers. Our team-based approach ensures that students gain valuable insights from a multiplicity of perspectives</font></p><h5><font color="#424242">The Right Choice</font></h5><p><font color="#424242">With so many selective programs to choose from, our team of counsellors will help students and identify their core values and goals, and match them with the best-fit schools for them. Just like the applicants are choosing between programs, schools are selectively looking for students that will fit their vision for their community, so our knowledgeable counsellors&nbsp;help students find a university that is right for them.&nbsp;</font><br></p><h5><font color="#424242">Present Your Best You</font></h5><p><font color="#424242">In competitive application processes, often the best way to stand out is through the more creative portion of the application process such as the essays and personal statements. Our counsellors will create a plan for applicants to showcase their individual talents, as well as brainstorm and review essays and personal statements produced by the applicant. Our goal is to help the student craft a unique and compelling story told through each section of their application.&nbsp;</font><br></p><h5><font color="#424242">Interview with confidence</font></h5><p><font color="#424242">Some universities require face-to-face interviews with the applicants. These are high-stakes, nerve-wracking situations, but with preparation, this is where students can make themselves shine. With our expert team of interview coaches and insight into interview processes, we will prepare students so there are no surprises. Each school has something unique they are looking for in prospective students, so our counsellors&nbsp;ensure every applicant walks into interview prepared.&nbsp;</font><br></p><h5><font color="#424242">Lifelong Impact</font></h5><p><font color="#424242">University applications are arduous but ultimately reward the student with the career path of their choice. At Opus, we provide guidance throughout the entire application process. Our mission is to make sure that each applicant gets a chance to tell his or her story to the admission committee. We focus on not just the short-term, but the long-term success of the applicant. We believe in guiding the applicant to foster a passion and intellectual curiosity that will help them succeed in all their future endeavours.</font><br></p><h5><font color="#424242">Our Services - Personal Attention</font></h5><p><font color="#424242">We offer various comprehensive planning packages for students, providing your child with individualized attention and the guidance to help them make the best decision. We assist with the following critical components to presenting a successful candidate to your chosen university:</font><br></p><ul><li><font color="#424242">University Admissions Counselling Packages: a complete range of packages that suit your individual needs. Packages available for students from Grade 6 through 12.</font></li><li><font color="#424242">Test Preparation (SAT, ACT, TOEFL, IELTS),</font></li><li><font color="#424242">Academic Subject Tutoring, and subjects of the Advanced Placement (AP) exams as well as International Baccalaureate (IB) tests.</font></li><li><font color="#424242">Competitions, Special Projects, Research Opportunities and Internships</font></li><li><font color="#424242">Portfolio Preparation (Art , Music and Drama)</font></li><li><font color="#424242">Interview Skills</font></li><li><font color="#424242">Deferral / Wait List Consultation</font></li><li><font color="#424242">Transfer Students Admissions</font></li></ul><h5><font color="#424242">Global Access</font></h5><p><font color="#424242">Our services are also available to students from across the country and around the world. At Opus, we can work with students in person, over the phone, via Skype, Zoom, or email.</font></p><h5><font color="#424242">Professional Standards</font></h5><p><font color="#424242">Opus Academy is a member of NACAC and its counsellors abide by the principles of good practice set by National Association for College Admissions Counselling (NACAC) and the Independent Educational Consultants Association (IECA).</font><br></p>', 0, '2022-04-21 16:40:03', '2022-07-12 06:35:41'),
	(4, 'Section IV', 'OpusAcademy  Top U.S. University Placement List', '<p>We are proud to have numerous students admitted to the following top universities over the years:</p><p><br></p><table class="table table-bordered"><tbody><tr><td><p></p><h5><font color="#efefef">Other Top Schools</font></h5><font color="#efefef">Architectural Association - School of Architecture<br>Babson College<br>BarnardCollege<br>BentleyUniversity<br>BostonCollege<br>BostonUniversity<br>Brandeis University<br>Colgate University<br>DukeUniversity<br>EmersonCollege<br>GeorgetownUniversity<br>Georgia Institute of Technology<br>JohnsHopkins University<br>Middlebury College<br>New YorkUniversity<br>Northwestern University<br>Parsons School of Design<br>Pratt Institute<br>RiceUniversity<br>RoyalCollege of Surgeons<br>Santa Clara University<br>School of the Art Institute of Chicago<br>SmithCollege<br>Southern California Institute of Architecture (SCI  Arc)<br>StanfordUniversity<br>SyracuseUniversity<br>University of California,<br>(Berkeley, Davis, Irvine, Los Angeles ,Riverside, Santa Barbara )<br>University of Chicago<br>University of Illinois at Urbana-Champaign<br>University of Oregon<br>University of Southern California<br>University of Washington<br>University of Washington  St. Louis<br>WilliamsCollege</font><p></p></td><td><p></p><h5><font color="#efefef">Ivy League</font></h5><font color="#efefef">BrownUniversity<br>ColumbiaUniversity<br>CornellUniversity<br>DartmouthCollege<br>HarvardUniversity<br>University<br>PrincetonUniversity<br>YaleUniversity</font><p></p></td></tr></tbody></table><p><br></p><p><br></p>', 0, '2022-04-26 16:22:16', '2022-06-14 06:48:25'),
	(5, 'Section V', 'Graduate School Admissions Counselling', '<p><font color="#424242">Opus Academy can help guide graduate school applicants through the arduous task of compiling their candidacy portfolios. We provide excellent resources and access to instructors and counsellors who have years of expertise in numerous fields of study. We will guide you down the path of how best to increase test scores, publish articles, enhance work experience, and improve personal statements and application essays.&nbsp;</font></p><p><font color="#424242">We provide Admissions Counselling for the following:</font></p><ul><li class="list-group-item" style="padding: 0.5rem 1rem; border-top-width: 0px; border-right-width: 0px; border-left-width: 0px;"><font color="#424242">Graduate School</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; border-right-width: 0px; border-left-width: 0px;"><font color="#424242">Law School Admissions</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; border-right-width: 0px; border-left-width: 0px;"><font color="#424242">Business School Admissions</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; border-right-width: 0px; border-left-width: 0px;"><font color="#424242">Medical School Admissions</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px;"><font color="#424242">Dental School Admissions</font></li></ul><h5><font color="#424242">Additional Resources</font></h5><h5><div class="row" open="" sans",="" sans-serif;="" font-size:="" 16px;"="" style="margin-right: calc(-0.5 * var(--bs-gutter-x)); margin-left: calc(-0.5 * var(--bs-gutter-x)); --bs-gutter-x:1.5rem; --bs-gutter-y:0; margin-top: calc(-1 * var(--bs-gutter-y));"><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">College Search Resource Links:</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- US News and World Report</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- College Prowler</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- College Confidential</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- YouVisit.com</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- http://www.noodle.org/colleges</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- Athletes: NCAA Eligibility Center (http://ncaa.org/)</span></font></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">Standardized Testing:</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- College Board</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- ACT</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- SSAT</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- ERB (Educational records Bureau)</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- TOEFL - ETS</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- FairTest.org</span></font></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">Testing Resources:</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- GMAT</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- GRE</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- LSAT</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- MCAT</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- DAT</span></font></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">Graduate Resources:</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- Graduate School Directory</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- AAMC: Association of American Medical Colleges</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- GMAC: Graduate Management Admission Council</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- LSAC: Law School Admissions Council</span></font></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">University Resources:</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- The Common Application</span></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 18px;">- University of California Common Application</span><br></font></li></ul></div></div></h5><h5><font color="#424242">Additional Resources</font></h5><p class="text-underline"><font color="#424242">Seminars</font></p><ul class="list-group list-group-flush" style="color: rgb(49, 48, 48); font-family: &quot;Open Sans&quot;, sans-serif;"><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);"><font color="#424242">OPUS PARENT EDUCATION SEMINAR SERIES</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);"><font color="#424242">OPUS STUDENT EDUCATION SEMINAR SERIES</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);"><font color="#424242">PARENT GROUP GATHERINGS</font></li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);"><font color="#424242"><br></font></li></ul><p><font color="#424242">We are pleased to share our knowledge with both parents and students in group settings. Opus representatives have spoken at educational conferences, fundraising events, recitals, and the Opus Education Seminar Series. Our Opus student alumni have also spoken at these events, providing them the opportunity to share their experiences as students of our academy.</font></p><p><font color="#424242">Topic include:</font></p><p><font color="#424242">University Admissions:</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Demystifying the College Admissions Process</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Trends in the College Admission Process</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Admissions Planning for Students</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>UK Admissions</font></p><p><font color="#424242">General Topics:</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Study Skills for students&nbsp;</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Parenting Tips for Middle School and High School students</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Private or Public School Choice</font></p><p><font color="#424242"><span style="white-space: pre;">	</span>Early Educational Planning</font></p><p><font color="#424242"></font></p><p><font color="#424242">INVITE us to speak at your event. We can speak English with Mandarin translation.&nbsp;</font></p>', 0, '2022-04-26 16:29:22', '2022-07-12 07:08:37');

