INSERT INTO `card_content` (`card_id`, `section`, `card_title`, `img`, `content`, `link`, `sort`, `page`, `card_status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'K-12 Private School Admissions', '../admin/assets/img/admission/private.jpg', '&lt;font color=&quot;#424242&quot;&gt;Our counsellors work with your family to assist you with your chosen schools admission process. We are there every step of the way to ensure your child has the best chances. Whether interested in private schools on a national or international level, we will help your family make the best choice, and make your childs individual needs our priority. Our counsellors help identify the private day schools or boarding schools that will best fit your childs needs, and programs that your child will flourish in.&lt;/font&gt;&lt;br&gt;', '', 0, 'admission-counselling.php', 0, '2022-04-27 08:18:55', '2022-07-12 06:26:17'),
	(2, 'Section I', 'University Admissions Counselling', '../admin/assets/img/admission/university.jpg', '&lt;font color=&quot;#424242&quot;&gt;We understand how demanding the university application process can be. With close guidance and attention from our select counsellors, your child will be able to navigate through the complex admissions process with ease. Our counsellors are committed to providing personalized services and ensure that your child finds the right university for them. Through our assistance, we can help showcase every individual strength and talent, helping create a top quality admission package that reaches chosen universities.&lt;/font&gt;', '', 0, 'admission-counselling.php', 0, '2022-04-27 10:40:02', '2022-07-12 06:27:36'),
	(3, 'Section I', 'Graduate and Professional Schools', '../admin/assets/img/admission/graduate.jpg', '&lt;font color=&quot;#424242&quot;&gt;Our counsellors help students who are applying to business schools, law schools, medical schools, and other graduate programs.&lt;/font&gt;', '', 0, 'admission-counselling.php', 0, '2022-04-27 14:41:07', '2022-07-12 06:28:08'),
	(4, 'Section I', 'Communication Arts Speech and Drama', '', '', 'opus_dev/communication-arts.php', 0, 'opus_dev/', 0, '2022-05-26 08:15:14', '2022-05-26 00:15:55'),
	(5, 'Section II', 'Early Learning (Individual): Stage 1, 2 and 3', '', '&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;In these classes, young children will learn to:&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt; Exchange greetings and give simple introductions&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt; Recite a poem, prose piece, action rhymes or nursery rhymes with expression and movements from memory&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt; Perform a mime scene&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt; Act a brief drama speech in character&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;line-height: 19px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt; Show and tell&amp;nbsp;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;', '', 0, 'early-learning.php', 0, '2022-06-02 15:46:19', '2022-07-12 08:47:13'),
	(6, 'Section II', 'Early Learning (Group): Stage 1, 2 and 3', '', '&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;In addition to the above skills for Individual learners, students enrolled in Group Learning classes will learn to:&lt;/font&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt; Perform an action rhyme, nursery rhyme, singing/acting game as part of a group&amp;nbsp;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt; Share a short story as a group with each member, promoting teamwork and group cohesion&lt;/font&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, 'early-learning.php', 0, '2022-06-02 15:48:41', '2022-07-12 08:47:47'),
	(7, 'Section I', 'Mathematics', '', '&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;Courses developed by Stanford University, in collaboration with McGraw Hill Education&lt;/span&gt;&lt;br&gt;', '', 0, 'mcgraw-hill-education-courses.php', 0, '2022-06-13 15:34:17', '2022-07-08 08:01:14'),
	(8, 'Section I', 'Language Arts &amp; Writing', '', '&lt;font color=&quot;#424242&quot;&gt;Courses developed by Stanford University, in collaboration with McGraw Hill Education&lt;/font&gt;', '', 0, 'mcgraw-hill-education-courses.php', 0, '2022-06-13 15:35:02', '2022-07-08 08:01:21'),
	(9, 'Section I', 'Secondary Mathematics', '', '&lt;font color=&quot;#424242&quot;&gt;McGraw Hill Education and Assessment and Learning in Knowledge Spaces (ALEKS)&lt;/font&gt;', '', 0, 'mcgraw-hill-education-courses.php', 0, '2022-06-13 15:35:34', '2022-06-13 08:27:05'),
	(10, 'Section I', 'Communication Arts Speech and Drama', '../admin/assets/img/home_page/cover-2.jpg', '&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;Our multifaceted programs train students in speech arts and drama, while helping to discover and hone young voices through a creative mix of literary art forms. As they progress, students challenge&amp;nbsp;&lt;span style=&quot;font-size: 1rem;&quot;&gt;themselves by participating in competition and receiving certifications.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;', 'http://localhost/opus_dev/communication-arts.php', 1, 'home.php', 0, '2022-06-14 16:03:28', '2022-07-12 07:25:31'),
	(11, 'Section I', 'Academic Enrichment', '../admin/assets/img/home_page/cover-1.jpg', '&lt;font color=&quot;#424242&quot;&gt;We are proud to offer English and Mathematics&amp;nbsp;enrichment courses developed by Stanford University through our relationship with McGraw Hill Education.Coursework is composed of supplemental materials which will assist students to excel in whichever field they choose&lt;/font&gt;', 'http://localhost/opus_dev/mcgraw-hill-education-courses.php', 5, 'home.php', 0, '2022-06-14 16:03:58', '2022-07-12 05:10:08'),
	(12, 'Section I', 'Admissions Counselling', '../admin/assets/img/home_page/cover-4.jpg', '&lt;font color=&quot;#424242&quot;&gt;We provide counselling services, essay coaching, and interview training for admissions into private day/boarding schools, universities, and graduate schools across the United States, Canada, the United Kingdom, and abroad.&lt;/font&gt;', 'http://localhost/opus_dev/admission-counselling.php', 4, 'home.php', 0, '2022-06-14 16:04:32', '2022-07-11 05:44:47'),
	(13, 'Section I', 'Communication Arts Public Speaking Debate', '../admin/assets/img/home_page/cover-3.jpg', '&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;Effective speaking skills are crucial for success. Our multilevel public speaking &amp;amp; debate programs train students the fine art of speaking, argumentation and persuasion.&amp;nbsp;&lt;/font&gt;&lt;span style=&quot;color: rgb(66, 66, 66); font-size: 1rem;&quot;&gt;Students also gain exposure to&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(66, 66, 66); font-size: 1rem;&quot;&gt;interview technique and negotiation.&lt;/span&gt;&lt;/div&gt;', 'http://localhost/opus_dev/communication-arts.php', 3, 'home.php', 0, '2022-06-14 16:04:54', '2022-07-12 07:23:17'),
	(14, 'Section I', 'Standardized Test Preparation', '../admin/assets/img/home_page/cover-5.jpg', '&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;We provide academic enrichment in core academic subjects and Advanced Placement courses.&amp;nbsp;We also offer Standardized Test preparation for SAT, ACT, Subject Tests, SSAT, and ISEE necessary for university and private school admissions.&lt;/span&gt;', 'http://localhost/opus_dev/test-preparation.php', 6, 'home.php', 0, '2022-06-14 16:04:57', '2022-07-11 06:00:28'),
	(15, 'Section I', 'Early Learning', '../admin/assets/img/home_page/cover-6.jpg', '&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;Our programs emphasize speech and language arts specifically geared towards early childhood,&amp;nbsp;and assist with the development of interactive oral communication,&amp;nbsp;&amp;nbsp;confidence, as well as etiquette and emotional intelligence.&lt;/span&gt;&lt;br&gt;', 'http://localhost/opus_dev/early-learning.php', 7, 'home.php', 0, '2022-06-14 16:05:00', '2022-07-11 05:59:46'),
	(19, 'Section I', 'Test With Upload', '', '&lt;font color=&quot;#424242&quot;&gt;asdasdasdasd&lt;/font&gt;', '', 0, 'home.php', 1, '2022-06-20 14:36:12', '2022-07-12 01:55:49'),
	(21, 'Section I', 'Our Partnership', '../admin/assets/img/home_page/cover-7.jpg', '&lt;font color=&quot;#424242&quot;&gt;The art of debate has been a defining part of Western culture since the ancient Greeks. Through debate, students deepen their understanding of the world and look for solutions to local, national and global issues.&lt;/font&gt;', 'http://localhost/opus_dev/competitive-debate-programs.php?canada', 2, 'home.php', 0, '2022-07-08 08:38:30', '2022-07-11 05:44:23');

