-- Dumping data for table opus.careers: ~2 rows (approximately)
INSERT INTO `careers` (`id`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Careers', '<div><font color="#424242">At Opus Academy, we succeed because of our greatest asset --our people. Our exceptional staff and qualified instructors are carefully selected and trained to draw out the best from their students. They not only bring in their wealth of expertise but most importantly their passion for teaching and student success.</font></div><div><font color="#424242"><br></font></div><div><font color="#424242">We are constantly seeking exceptional talent to join our growing team. Together, we can make an impact in the lives of young people. If you are a dedicated lifelong learner who is passionate about student success and intellectual pursuits, please send your resume and cover letter to hr@opusacademy.com.</font></div><div><font color="#424242"><br></font></div><h5><font color="#424242">We are hiring the following positions:</font></h5>', 0, '2022-05-10 16:11:09', '2022-07-12 07:11:55');

