-- Dumping data for table opus.classical_music: ~5 rows (approximately)
INSERT INTO `classical_music` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Opus Classical Music Program', '<p></p><div><div><font color="#424242">Experience the joy of music through Opus Academys outstanding Classical Music program! We assist students in realizing their creative and musical potential, while fostering a deep breadth of musical knowledge and appreciation that they will carry throughout life. Our program is a great way to further develop your childs musical skills, provide them with encouragement and confidence throughout.</font></div><div><font color="#424242"><br></font></div><div><font color="#424242">Through our modern, spacious facilities and highly qualified teachers, our range of course offerings will allow your child to thrive under masterful guidance as they complete musical education in piano and music theory.&nbsp;</font></div></div><p></p><p><font color="#424242"><br></font></p><p style="text-align: center; "><img style="width: 950px; margin: 2%" src="data:image/jpeg;base64," data-filename="classical.jpg" alt="" title="classical-music-img" class=""><font color="#424242"><br></font></p>', 0, '2022-06-09 09:01:36', '2022-07-12 07:28:14'),
	(2, 'Section II', 'Classical Music Studies', '<p style=""><font color="#424242" style="">We offer a wide range of classical music through curriculum-based programs, as students can select from the following certifying bodies:</font></p><ol style="padding-left: 2rem;"><li><font color="#424242" style="">Royal Conservatory of Music</font></li><li><font color="#424242" style="">Trinity College of London</font></li><li><font color="#424242" style="">London College of Music</font></li><li><font color="#424242" style="">Associated Board of the Royal Schools of Music</font></li></ol><p><font color="#424242" style=""><br></font></p><h5><font color="#424242" style="">Classical Music Program</font></h5><p style=""><font color="#424242" style="">Private Instruction</font></p><p style=""><span style="color: rgb(66, 66, 66);">We currently offer instrumental instruction in piano for students of all ages.</span><font color="#424242" style=""><br></font></p><p style=""><font color="#424242" style="">Theory Classes</font></p><p style=""><font color="#424242" style="">We offer a complete range of theory classes at the Basic and Advanced levels to meet the exam requirements of Royal Conservatory of Music, Trinity College of London, London College of Music and ABRSM Diploma programs.</font></p>', 0, '2022-06-09 10:42:26', '2022-07-12 07:28:56'),
	(3, 'Section III', 'Courses include:', '<ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">- Rudiments: Preliminary, Intermediate and Advanced Harmony and Counterpoint</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">- Analysis and Counterpoint</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">- Viva Voce (ABRSM, TCL, LCM)</font></li></ul><h5 class="mt-3"><font color="#424242">History Classes:</font></h5><p><font color="#424242">History courses are taught using a stimulating combination of lecture and audio-visual presentation of diverse works and composers.</font><br></p><h5 class="mt-3"><font color="#424242">Ear Training and Sight Reading Classes:</font></h5><p><font color="#424242">Students focus on technique, ear training, note reading, rhythm, keyboard theory and singing.</font></p><h5 class="mt-3"><font color="#424242">Advanced Placement (AP) Music Theory:</font></h5><p><font color="#424242">AP is recognised&nbsp;in the US, Canada and more than 40 countries. Students can earn credit or advanced standing in North American and international colleges and universities.</font></p>', 0, '2022-06-09 10:43:03', '2022-07-12 07:29:34'),
	(4, 'Section IV', 'Additional Learning Opportunities', '<h5 style=""><font color="#424242">Master Classes</font></h5><p style=""><font color="#424242">Students can join Master Classes which will provide helpful evaluation leading to increased confidence and heightened musical learning experiences. Master Class students can join our annual grand recitals and other performance venues.&nbsp;</font><br></p><h5 style=""><font color="#424242">Music Festivals &amp; Competitions</font></h5><p style=""><font color="#424242">For a full musical learning experience, students may also participate in various local, national, or international festivals and competitions, such as Kiwanis Music Festival, Vancouver Music Festival, Student Performers Guild, Canadian Music Competition, and many more.&nbsp;</font><br></p><h5 style=""><font color="#424242">Workshops</font></h5><p style=""><font color="#424242">Special workshops focus on communication skills, pedagogy skills and learning theory.&nbsp;</font><br></p><h5 style=""><font color="#424242">Teachers</font></h5><p style=""><font color="#424242">Our highly qualified and experienced teachers are committed to students\' musical and artistic growthmotivating, encouraging, and inspiring young musicians to realize their dreams and reach their full potential. Each one of our teachers are highly trained experts with extensive musical background and specialization.&nbsp;</font><br></p>', 0, '2022-06-09 10:43:23', '2022-07-12 07:30:32'),
	(5, 'Section V', 'Application Procedure', '<p><font color="#424242">We welcome students of all ages and all levels to our Classical Music Program.</font></p><ol style="padding-left: 2rem;"><li><font color="#424242">To apply, students will set up an appointment for an interview and audition. The appointment is an opportunity for the teacher to meet the student and assess the applicant\'s skill level prior to planning their program of study.</font></li><li><font color="#424242">Applicants are requested to play pieces of different styles, and to demonstrate sight reading skills and technique.</font></li><li><font color="#424242">Applicants should bring recently played music, as well as a list of pieces studied in the recent past.</font></li></ol>', 0, '2022-06-09 10:43:33', '2022-07-08 08:08:57');

-- Dumping structure for table opus.communication_arts
CREATE TABLE IF NOT EXISTS `communication_arts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `section` varchar(50) NOT NULL,
  `title` varchar(100) NOT NULL,
  `content` longtext NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT 0,
  `date_added` datetime NOT NULL DEFAULT current_timestamp(),
  `date_update` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4;

-- Dumping data for table opus.communication_arts: ~8 rows (approximately)
INSERT INTO `communication_arts` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Communication Arts', '<p><font color="#424242">Effective spoken communication is critical for success in today\'s highly competitive world. At Opus, we are committed to teaching students the art of public speaking, debate, speech arts, and drama to develop their creativity and expression. Our goal is to train students of all ages to speak and perform with self-assurance, empowering them for a lifetime of success in their personal and professional lives.&nbsp; &nbsp;</font></p><p><font color="#424242">Our expert instructors are experienced public speakers and educators, holding advanced degrees from highly established universities. They not only bring their expertise to the classroom, but also their passion for teaching. By engaging, inspiring, and motivating students to develop effective communication skills, our instructors are exemplary role models, instilling a love of learning and sharing their skills with students as they venture into the exciting world of public speaking.&nbsp;</font></p>', 0, '2022-06-09 12:43:24', '2022-07-12 07:52:57'),
	(2, 'Section II', 'Opus Communication Arts Courses', '<p open="" sans",="" sans-serif;"=""><font color="#424242">We strive to provide students with a solid foundation for effective communication, as well as develop their confidence and competence in using the English language with utmost effect. We aim to stimulate critical thinking so that students develop greater insight into the appreciation of literature, spoken word, and the formulation of rhetoric.</font></p><p open="" sans",="" sans-serif;"=""><font color="#424242">Our expert instructors are experienced public speakers and educators, holding advanced degrees from highly established universities. They not only bring their expertise to the classroom, but also their passion for teaching. By engaging, inspiring, and motivating students to develop effective communication skills, our instructors are exemplary role models, instilling a love of learning and sharing their skills with students as they venture into the exciting world of public speaking.</font></p><p><font color="#424242">At Opus, we pride ourselves on our comprehensive program, allowing students to discover their own voices through a creative mix of prose, poetry, drama, storytelling, and improvisation. At Opus, students learn to interpret and perform a variety of literary forms from western classical and modern literature. Our courses build on a young learner\'s expressive potential and teaches the accompanying vocabulary and language skills necessary for appreciating and performing various literary art forms. Alongside improvisation techniques, drama games, and other activities to stimulate their imaginations, we help young learners build their character through expressive movement and voice. Students learn relaxation methods, proper breathing techniques, as well as projection and articulation.</font></p><div class="justify-content-center mt-4" open="" sans",="" sans-serif;"=""><h5><font color="#424242">Our well-designed curricula include:</font></h5><font color="#ffffff"><span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">vocal technique</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">improvisation and impromptu speaking</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">storytelling</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">public speaking</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">mime &amp; creative movement</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">acting styles</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">oral interpretation (poetry and prose)</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">scene study</span>&nbsp;<span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">Shakespeare</span></font></div><div class="mt-4" open="" sans",="" sans-serif;"=""><p><font color="#424242">We offer a wide selection of Speech &amp; Drama syllabi tailored to your childs individual needs and interests. Students learn through a structured framework and partake in a series of graded examinations leading to a diploma. Students can choose different syllabi strands from international certification boards such as Royal Conservatory of Music (Canada), London College of Music (UK) and Trinity College of London (UK). Significant long-term benefits include the potential of various courses counting towards high school, as well as performance opportunities including recitals, workshops, festivals, and competitions.&nbsp;&nbsp;</font></p><p><font color="#424242">Class formats are offered in select groups, pairs, or private lessons. Group and pair classes are an excellent way for students to develop their confidence and expressiveness in a supportive environment, while private lessons are encouraged for students eager to develop expressive speech in a more individualized, structured, goal-setting environment.&nbsp;&nbsp;</font></p></div>', 0, '2022-06-09 12:50:32', '2022-07-12 07:54:25'),
	(3, 'Section III', 'Certificates and Diplomas', '<p><font color="#424242">The following examinations provide an international standard for students wishing to have their progress as performers and public speakers formally recognized.</font></p><h5 class="mt-4"><font color="#424242">I. Royal Conservatory of Music (RCM) Canada</font></h5><p><font color="#424242">There are ten RCM Speech &amp; Drama grades, followed by a capstone diploma. The graded exams consist of a performance in a mix of styles, increasing in length and complexity, followed by critical discussion. Starting in Grade 7, students will also complete co-requisite theory courses in technique and literature.</font></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate Diploma - Speech Arts and Drama (A.R.C.T.)</font></li></ul><p><a href="http://www.rcmexaminations.org/" target="_blank">www.rcmexaminations.org</a></p><h5 class="mt-4"><font color="#424242">II. London College of Music (England)</font></h5><p><font color="#424242">There are three introductory levels, eight LCM Speech and Drama grades, followed by four performance diplomas, some of which may be completed while the student is in high school. In addition, there are three teaching diplomas. The exams consist of a performance in a mix of styles, sight reading, a discussion, and a portfolio. Later grades expect students to choose their pieces around a unified theme for their recital.</font></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Diploma of the London College of Music (DipLCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate of the London College of Music (ALCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Licentiate of the London College of Music (LLCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Fellowship of the London College of Music (FLCM)</font></li></ul><h6 class=""><font color="#424242"><br></font></h6><h6 class=""><font color="#424242">The syllabi strands for London College of Music are:</font></h6><ol type="a" style="padding-left: 2rem;"><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Early Learning</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Speech &amp; Drama</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Verse Speaking</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Acting</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Reading Aloud</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Duologue</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Choral Speaking</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Group Performance</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Musical Theater</font></span></li></ol><h5 class="mt-4"><font color="#424242">III. Trinity College of London (England)</font></h5><p><font color="#424242">There are eight TCL Speech &amp; Drama grades, followed by three levels of diploma, some of which may be completed while the student is in high school. The exams consist of a performance in several styles, each increasing in length and complexity with improvisation, critical discussion, and illustrative presentations.</font><br></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate Diploma (A.T.C.L.)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Licentiate Diploma (L.T.C.L.)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Fellowship Diploma (F.T.C.L.)</font></li></ul><h6><font color="#424242"><br></font></h6><h6><font color="#424242">The syllabi strands for Trinity College of London are:</font></h6><ol type="a" style="padding-left: 2rem;"><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Acting &amp; Speaking</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Musical Theater</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; --bs-bg-opacity:1;"><font color="#ffffff">Performance Arts</font></span></li></ol><p><a href="http://localhost/opus_dev/www.trinitycollege.co.uk"><font color="#424242">www.trinitycollege.co.uk</font></a></p>', 0, '2022-06-09 12:50:38', '2022-07-12 07:58:02'),
	(4, 'Section IV', 'Public Speaking and Debate', '<div class="row" open="" sans",="" sans-serif;"="" style="--bs-gutter-x:1.5rem; --bs-gutter-y:0; margin-top: calc(-1 * var(--bs-gutter-y)); margin-right: calc(-0.5 * var(--bs-gutter-x)); margin-left: calc(-0.5 * var(--bs-gutter-x)); color: rgb(49, 48, 48); font-family: "><div class="col-xl-12 col-lg-12" style="flex-basis: auto; width: 1320px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y);"><div class="content text-center" style="padding: 30px; background: rgba(41, 23, 110, 0.86); border-radius: 4px; color: rgb(255, 255, 255);"><h5 style="font-family: Raleway, sans-serif;">Public speaking is North America\'s greatest fear.</h5><h5 style="font-family: Raleway, sans-serif;"><p style="font-family: " open="" sans",="" sans-serif;="" font-size:="" 16px;"="">Nervous in front of a crowd?<br>Having trouble with class presentations?<br>Want to be a better speaker?</p><br style="font-family: " open="" sans",="" sans-serif;="" font-size:="" 16px;"=""></h5><h6 style="font-family: Raleway, sans-serif;">The answer is Opus Academy\'s</h6><h5 style="font-family: Raleway, sans-serif;">PUBLIC SPEAKING PROGRAM</h5><h5 style="font-family: Raleway, sans-serif;"><br style="font-family: " open="" sans",="" sans-serif;="" font-size:="" 16px;"=""></h5><h5 style="font-family: Raleway, sans-serif;">LEARN TO SPEAK. SPEAK TO LEARN.</h5><h6 style="font-family: Raleway, sans-serif;">Speak with confidence, clarity and conviction! Communication skills can be taught and learned.</h6></div></div></div><br open="" sans",="" sans-serif;"="" style="color: rgb(49, 48, 48); font-family: "><p style=""><font color="#424242">At Opus Academy, we take the fear out of public speaking and empower young minds to speak with articulation and confidence. Our Public Speaking and Debate Program is a comprehensive multi-level program developed to provide the highest quality of public speaking and debate training for children and teens alike. We prepare students to speak with clarity and conviction, providing them with the life-long skills of effective and engaging speaking as they venture into the world as global citizens.</font></p><p style=""><font color="#424242">Students learn the critical components of public speaking. From vocal articulation and breath control to the art of speechwriting and delivery, students will be inspired to convey their ideas effectively. Additional skills learned will improve their research abilities, critical thinking skills, and interpretive reading strategies. These foundational tools are applicable towards any class and any grade level.</font></p><p style=""><font color="#424242">Students learn to apply their acquired skills through classroom presentations, discussions, formal speeches, social interaction, and essay writing.</font></p><h5 style=""><font color="#424242">Our well-designed curriculum includes:</font></h5><h5 style=""><ul class="list-group list-group-flush" style="font-size: 16px;"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Elements of Public Speaking - emphasis, verbal and non-verbal communication, projection, articulation, eye contact, gesture, poise, and posture</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Mental Gymnastics - thinking on ones feet</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Various types of speeches - persuasive, informative, entertaining, and demonstrative</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Delivery - impromptu, extemporaneous, prepared or memorized</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Speech writing - topic selection, organization, research, development, and mechanics</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Oral presentations &amp; prepared talks</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Debate &amp; argumentation (logic)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Discussion &amp; research</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Conversations &amp; speaking on social occasions (introduction, thank you, farewell, toast, etc.)</font></li></ul></h5><h5 style=""><p style="font-size: 16px;"><font color="#424242">Class formats are available in small groups, pairs, or private lessons. Group and pair classes are an excellent way for students to develop their confidence and expression in a supportive environment. Private lessons are suited for students eager to develop expressive speech in a more individualized, structured, and goal-setting environment.&nbsp;&nbsp;</font></p></h5>', 0, '2022-06-09 12:50:45', '2022-07-12 07:59:33'),
	(5, 'Section V', 'Certificate and Diploma Granting', '<p><font color="#424242">For a curriculum-based program, students can choose from the following certifying bodies:</font></p><h5 class="mt-4"><font color="#424242">I. Royal Conservatory of Music (RCM) Canada</font></h5><div class="description"><p><font color="#424242">The RCM Speech &amp; Drama syllabus teaches public speaking skills by introducing students to a range of performance styles, including poetry &amp; prose recital, drama, speechcraft, and improvisation. The ten graded certificates are followed by a capstone diploma.</font></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate Diploma - Speech Arts and Drama (A.R.C.T.)</font></li></ul><font color="#424242"><br>&nbsp; &nbsp;&nbsp;<a href="https://rcmexaminations.org/">www.rcmexaminations.org</a></font></div><p><font color="#424242"><br></font></p><h5 class="mt-4"><font color="#424242">II. London College of Music (England)</font></h5><div class="description"><p><font color="#424242">There are three introductory levels, eight LCM Speech and Drama grades, followed by four diplomas, some of which may be completed while the student is in high school. Exams consist of prepared and impromptu speeches, sight reading, and critical discussion with the examiner. At diploma levels, students craft and deliver 2-3 speeches of varying style and content.</font><br></p><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Diploma of the London College of Music (DipLCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate of the London College of Music (ALCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Licentiate of the London College of Music (LLCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Fellowship of the London College of Music (FLCM)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><br></font></li></ul><h6 class=""><font color="#424242">The syllabi strands in communications for London College of Music are:</font></h6><ol type="a" style="padding-left: 2rem;"><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; background-color: transparent; --bs-bg-opacity:1;"><font color="#ffffff">Spoken English in Religion</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; background-color: transparent; --bs-bg-opacity:1;"><font color="#ffffff">Oral Communication/Public Speaking</font></span></li><li><span class="badge bg-primary" style="padding: 0.35em 0.65em; font-size: 12px; border-radius: 0.25rem; background-color: transparent; --bs-bg-opacity:1;"><font color="#ffffff">Personal &amp; Professional Communication</font></span></li></ol><p style="padding: 0.5rem 1rem;"><a href="https://lcme.uwl.ac.uk/qualifications" target="_blank"><font color="#424242">https://lcme.uwl.ac.uk/qualifications</font></a></p><h5 class="mt-4"><font color="#424242">III. Trinity College of London (England)</font></h5><div class="description"><p><font color="#424242">There are eight TCL Speech &amp; Drama grades, followed by three levels of diploma, some of which may be completed while the student is in high school. Exams consist of an interactive exercise, such as an interview or negotiation, followed by an oral summary and presentation. At diploma levels, students deliver five speeches of varying styles.</font><br></p><font color="#424242"><br></font><h5><font color="#424242">Diplomas available in Communication Skills (Public Speaking)</font></h5><ul class="list-group list-group-flush"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Associate Diploma (A.T.C.L.)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Licentiate Diploma (L.T.C.L.)</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Fellowship Diploma (F.T.C.L.)</font></li></ul><font color="#424242"><br><a href="http://localhost/opus_dev/www.trinitycollege.co.uk">www.trinitycollege.co.uk</a></font></div></div><div class="description" style=""></div><div class="container" style="width: 1296.01px; padding-right: var(--bs-gutter-x,0.75rem); padding-left: var(--bs-gutter-x,0.75rem); max-width: 1320px;"></div>', 0, '2022-06-09 12:50:51', '2022-07-12 08:01:10'),
	(6, 'Section VI', 'Interview Skills Program', '<p>&nbsp;&nbsp;<img src="data:image/jpeg;base64," style="height: 460.477px; float: right; width: 690.316px;" data-filename="p-10.jpg" class="m-4" alt="" width="" height="" title="" role=""><span style="color: rgb(66, 66, 66); text-align: justify; font-size: 1rem;"></span></p><div style="text-align: justify; "><div>Interviews can be a daunting task at any ages, let alone children and teens. With the help of our experts at Opus Academy, we will help your child rise to the occasion and master !</div><div><br></div><div>Opus has a long-standing history preparing students for the interviewing world, whether it be for private school admissions, universities, or internships. The ability to express oneself in interview settings is one of the most important skills a student can acquire. In this course, students learn how to communicate effectively, making the most of their qualifications and extra-curricular experiences. Students are placed in a mock interview setting, where they are evaluated by an instructor with experience both interviewing candidates and teaching interview skills.</div><div><br></div></div>', 0, '2022-06-09 12:50:56', '2022-07-12 08:01:39'),
	(7, 'Section VII', 'Youth Leadership Program and Etiquette', '<p><font color="#424242">Time and again, science has proven that strong emotional intelligence in children leads to better decision making, motivation, and a heightened sense of self-awareness going forward in life. These factors are a pivotal foundation benefiting&nbsp;all young people, providing them with the fortitude required to succeed personally and professionally.&nbsp;</font></p><p><font color="#424242">This program is especially designed to present a multitude of skills necessary for positive personality development and strengthened emotional intelligence. Students will develop stronger communication skills, organizational goals, and gain essential leadership skills. They will study the essential qualities of a leader and learn conflict resolution skills through understanding social concepts and dynamics. In addition, this program prepares young people to present themselves well in a variety of social situations and at job interviews. The practical side of our courses are designed to increase knowledge and appreciation of good manners and etiquette, improving self-esteem, and respecting others. Our interactive sessions provide an ideal combination of instruction, practice, and role-playing activities in a fun and supportive environment.</font></p><h5 class="mt-4" style=""><font color="#424242">Topics covered include:</font></h5><ul class="list-group list-group-flush" style=""><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Personal image</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Communicating with confidence</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Dining etiquette</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Etiquette in public places</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Conducting meetings</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Conflict resolution</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Ethics and values</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Cultural proficiency</font></li></ul><h5 class="mt-4" style=""><font color="#424242">Courses offered:</font></h5><ol type="1" style="padding-left: 2rem;"><li style=""><font color="#424242">Youth Leadership Training</font></li><li style=""><font color="#424242">Etiquette and Personality Empowerment for Youth</font></li><li style=""><font color="#424242">Etiquette for Kids</font></li></ol>', 0, '2022-06-09 12:51:05', '2022-07-12 08:02:38'),
	(8, 'Section VIII', 'International Relations', '<p><img src="data:image/jpeg;base64," style="width: 736.901px; float: right;" data-filename="p-12.jpg" class="m-4" alt="" title=""><span style="color: rgb(49, 48, 48); font-family: " open="" sans",="" sans-serif;"=""></span></p><div style="text-align: justify; "><font color="#424242">In the fast-paced and ever-changing world of the 21st century, it is critical for young minds to be prepared for the world at large by increasing their global awareness. At Opus, we introduce and engage students in the global effects of economic, social, and political processes, as well as issues of justice and responsibility through three courses: Current Events, Model UN, and Mock Trial.</font></div><p></p><h5 class="mt-4" style="text-align: justify;"><font color="#424242">Current Events</font></h5><p style="text-align: justify;" open="" sans",="" sans-serif;"=""><font color="#424242">This course increases young people\'s awareness of and responsiveness to issues and events that are important locally, nationally, and internationally.&nbsp; Students learn to differentiate between fact and opinion, as well as to critically analyze news and various media sources, developing their own perspectives in the process. Students will be equipped to not only engage with the news around them, but contribute to a wide range of topics and discussions on a global scale.</font><br></p><h5 class="mt-4" style="text-align: justify;"><font color="#424242">Model United Nations</font></h5><p style="text-align: justify;" open="" sans",="" sans-serif;"=""><font color="#424242">This course teaches the basics of constructing and analyzing diplomatic speeches, as well as constructing and presenting successful negotiation strategies. Students are assigned roles and given specific diplomatic goals to meet by the end of the conference. Students will develop the skills necessary to interpret, analyze, and debate global issues concerning diplomacy, politics, and international relations.</font></p><h5 class="mt-4" style="text-align: justify;"><font color="#424242">Mock Trial</font></h5><p style="text-align: justify;" open="" sans",="" sans-serif;"=""><font color="#424242">The Opus Mock Trial Program trains students to plan, draft, and present their claims for cross-examining and delivering opening and closing arguments. It additionally instructs students how to argue intelligently and logically while conducting courtroom procedures such as introducing material evidence and responding to objections. Students will increase their confidence, poise, oral skills, critical thinking skills, and teamwork.</font><br></p>', 0, '2022-06-09 12:51:13', '2022-07-12 08:03:44'),
	(9, 'Section IX', 'Awards and Honours', '<p style=""><font color="#424242">Opus students have won many awards for high achievement in various universally recognized examinations, competitions, and festivals such as the ones below in Speech and Drama, Communication Skills and Classical Music.</font></p><h5 class="mt-4" style=""><font color="#424242">Royal Conservatory of Music (RCM)</font></h5><p style=""><font color="#424242">In recognition of the dedication and hard work of those candidates who achieve outstanding results in their examinations, awards and scholarships are awarded each academic year by RCM Examinations.</font></p><h5 class="mt-4" style=""><font color="#424242">British Columbia (BC) Gold Medal Award</font></h5><p style=""><font color="#424242">Gold Medals are awarded yearly in each province to the candidates in Grades 1 to 10 who have obtained the highest marks in each grade and discipline.</font></p><h5 class="mt-4" style=""><font color="#424242">Mock Trial</font></h5><p style=""><font color="#424242">The Opus Mock Trial Program trains students to plan, draft, and present their claims for cross-examining and delivering opening and closing arguments. It additionally instructs students how to argue intelligently and logically while conducting courtroom procedures such as introducing material evidence and responding to objections. Students will increase their confidence, poise, oral skills, critical thinking skills, and teamwork.</font></p><h6 class="mt-4" style=""><font color="#424242">Opus students have received multiple Gold Medal awards in the past 18 years!</font></h6><h5 class="mt-4" style=""><font color="#424242">RCM First Class Honors with Distinction</font></h5><p style=""><font color="#424242">Awarded to candidates achieving a mark between 90 - 100.</font></p><h5 class="mt-4" style=""><font color="#424242">RCM Honors with Distinction</font></h5><p style=""><font color="#424242">Awarded to candidates achieving a mark between 80 - 89.</font></p><h5 class="mt-4" style=""><font color="#424242">London College of Music</font></h5><p style=""><font color="#424242">All successful candidates in the Grade and certificate examinations receive certificates showing their level of achievement as Pass, Merit or Distinction.</font></p><h5 class="mt-4" style=""><font color="#424242">LCM Distinction</font></h5><p style=""><font color="#424242">Awarded to candidates achieving a mark between 85-100</font></p><h5 class="mt-4" style=""><font color="#424242">Trinity College of London (TCL)</font></h5><p style=""><font color="#424242">All successful candidates in the Grade and Certificate examinations receive certificates showing their level of achievement as Pass, Merit or Distinction.</font></p><h5 class="mt-4" style=""><font color="#424242">TCL Distinction</font></h5><p style=""><font color="#424242">Awarded to candidates achieving a mark between 85 100</font></p><h5 class="mt-4" style=""><font color="#424242">Trinity Exhibition Award</font></h5><p style=""><font color="#424242">Highest Distinction mark in practical exams in Canada, the USA, Bahamas, and the West Indies.</font></p>', 0, '2022-06-09 12:51:45', '2022-06-09 05:43:20'),
	(10, 'Section X', 'Speech Competitions & Festivals', '<p><font color="#424242">Our students compete and win numerous awards annually in local, provincial, national and international competitions. They include:</font></p><h5 class="mt-4"><font color="#424242">Magnum Opus International Speech and Drama Competition with Showcase Recital at Carnegie Hall</font></h5><font color="#424242">(<a href="http://localhost/opus_dev/www.magnumopusfestival.org">www.magnumopusfestival.org</a>)</font><p><font color="#424242">Opus students won and performed at Carnegie Hall in New York City.</font></p><h5 class="mt-4"><font color="#424242">Performing Arts British Columbia</font></h5><p><font color="#424242">Opus students were selected from regional competitions to compete at the provincials many times in the past fifteen years, receiving prestigious awards.</font></p><h5 class="mt-4"><font color="#424242">Kiwanis Fraser Valley Festival</font></h5><p><font color="#424242">Opus students received top rankings the past ten years running</font></p><h5 class="mt-4"><font color="#424242">Vancouver Speech & Drama Festival</font></h5><p><font color="#424242">Opus students received top rankings the past five years running</font></p><h5 class="mt-4"><font color="#424242">BC Law Foundation Cup</font></h5>', 0, '2022-06-09 12:51:49', '2022-07-12 08:34:46');

