-- Dumping data for table opus.competitive_debate: ~8 rows (approximately)
INSERT INTO `competitive_debate` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Opus Competitive Debate Programs', '<section class="competitive-debate-programs" style="padding: 0px 0px 30px; overflow: hidden; position: relative; z-index: 3; color: rgb(49, 48, 48); font-family: " open="" sans",="" sans-serif;"=""><div class="container" style="width: 1320px; padding-right: var(--bs-gutter-x,0.75rem); padding-left: var(--bs-gutter-x,0.75rem); max-width: 1320px;"><div class="content" style="padding: 30px; background: rgba(41, 23, 110, 0.86); border-radius: 4px; color: rgb(255, 255, 255);"><h3 class="text-center text-white py-3" style="font-family: Raleway, sans-serif; --bs-text-opacity:1;">In partnership with Harvard Debate Council Bringing you<br>the best debate learning experience</h3><h3 class="text-center text-white py-3" style="--bs-text-opacity:1; color: rgba(var(--bs-white-rgb),var(--bs-text-opacity))  !important;"><center style="font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;"><img src="https://opusacademy.com/opus_dev/assets/img/hero/opus-tran.png" alt="harvard-img" width="15%"></center><br style="font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; text-align: start;"></h3><h3 class="text-center" style="font-family: Raleway, sans-serif;">Opus Competitive Debate Programs</h3><h6 class="text-center" style="font-family: Raleway, sans-serif;">Empowering future leaders through speech and debate</h6><h6 class="text-center" style="font-family: Raleway, sans-serif;">Learn to Speak! Speak to Learn!</h6><h6 class="text-center" style="font-family: Raleway, sans-serif;">Speak with power, confidence, clarity and conviction!</h6></div></div></section>', 0, '2022-06-14 10:34:57', '2022-07-11 02:17:56'),
	(2, 'Section II', 'Why learn to debate?', '<p><font color="#424242">The art of debate has been a defining part of Western culture since the ancient Greeks. Through debate, students deepen their understanding of the world and look for solutions to local, national and global issues. Early debate training helps students listen carefully, think logically and speak effectively. Students sharpen their reasoning and problem-solving skills by studying how to construct arguments, defend them through refutation, and cross-examine others. Debate teaches life skills essential to future success and is applicable to most any future career choice.</font></p><p><font color="#424242">Research shows that students who practice debate perform better academically, attain higher standardized test scores, gain increased college admissions, and achiever greater success in their careers.&nbsp;</font></p>', 0, '2022-06-14 10:35:18', '2022-07-12 08:35:38'),
	(3, 'Section III', 'Why learn with us?', '<div><font color="#212529"><br></font></div><ul class="list-group" open="" sans",="" sans-serif;"="" style="border-radius: 0.25rem; color: rgb(49, 48, 48);"><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">Exclusive partnership with <b>Harvard Debate Council</b></li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">Top - level Instructors</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">College Prowler</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">Highly developed Curriculum</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">Years of Excellence&nbsp;<span style="font-weight: bolder;">(Harvard Debate Council: established over 35 years and Opus Academy: established over 16 years)</span></li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">Excellent student-faculty ratio</li></ul><p><font color="#424242"><br></font></p><p><font color="#424242">Provide your child with the opportunity of a lifetime</font></p>', 0, '2022-06-14 10:35:26', '2022-07-12 08:37:35'),
	(4, 'Section IV', 'Our Program Structure', '<p><font color="#424242">Our first-class debate program provides students with the knowledge, skills, and technique necessary to master debate. Through a well-designed sequential program consisting of core concepts, established methodology, and universal elements, students develop the ability to debate using logic, argumentation, and refutation  the hallmarks of any successful debater.</font><br></p><h5><div class="row" open="" sans",="" sans-serif;="" font-size:="" 16px;"="" style="margin-right: calc(-0.5 * var(--bs-gutter-x)); margin-left: calc(-0.5 * var(--bs-gutter-x)); --bs-gutter-x:1.5rem; --bs-gutter-y:0; margin-top: calc(-1 * var(--bs-gutter-y));"><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 16px;">Core Concepts</span><br></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 16px;">- Public Speaking Skills</span><br></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242"><span style="font-size: 16px;">- Logical Reasoning and Argumentation</span><br></font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Rhetoric</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Current Events</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Extemporaneous Speaking</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Teamwork and Leadership</span><br></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">Methodology</span><br></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Instruction &amp; Skill Development</span><br></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Critical Discussion</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- In-depth Topic Research</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Debate Practices</span><br></li></ul></div><div class="col-lg-4 col-md-6 mb-5" style="width: 440px; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); flex-basis: auto; max-width: 100%; margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">Elements</span><br></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Definition and Value of Debate</span><br></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Case Construction: evidence, argumentation, structure</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Research &amp; Critical Analysis (sources, plagiarism, citations)</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Trilogy of Aristotle - Ethos, pathos, &amp; logos</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Refutation</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Logical fallacies</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Cross-Examination</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Debate formats</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Speakers\' Duties</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Language and Delivery</span></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><span style="color: rgb(66, 66, 66); font-size: 16px;">- Mock debates</span></li></ul></div></div></h5>', 0, '2022-06-14 10:35:31', '2022-07-12 08:37:58'),
	(5, 'Section V', 'Opus Academy and Harvard Debate Council', '<p><font color="#424242">Opus Academy is proud to be in partnership with Harvard Debate Council, providing the opportunity for students to train with the worlds leading experts in international debate practices. Harvard Debate Council instructors have reached the highest levels of competition as coaches and competitors, helping students from around the world learn the art of debate.</font><br></p>', 0, '2022-06-14 10:35:35', '2022-07-12 08:39:52'),
	(6, 'Section VI', 'Harvard Debate Council Programs', '<h5><font color="#424242">I. Public Speaking and Argumentation</font></h5><p><font color="#424242">This course provides a solid foundation for communication in academic and career contexts. Students will learn the foundational elements of crafting outstanding persuasive speeches. Students will select a contemporary topic with a level of controversy and produce public policy and personal advocacy speeches.</font></p><h5 class="mt-5"><font color="#424242">II. Public Forum</font></h5><p><font color="#424242">Public Forum has rapidly become the most popular format of debate both in the United States and internationally. In a public forum debate round, two teams of two students debate for approximately 45 minutes on a national topic that changes throughout the school year. Students will debate several topics over the course of the year and will prepare for regular tournament competitions.</font></p><h5 class="mt-5"><font color="#424242">III. Policy Debate- Policy Debate</font></h5><p><font color="#424242">One of the oldest forms of debate competition most common to US high schools and US universities, is also the format favoured for the Harvard Debate Council competitions. In a policy debate round, two teams of two debate for approximately one hour and thirty minutes on an annual national topic related to domestic and/or international policy.</font></p>', 0, '2022-06-14 10:35:54', '2022-07-08 07:55:05'),
	(7, 'Section VII', 'Competitive Debating at Opus', '<p><font color="#424242">We train serious debaters to compete in regional, national, and international tournaments. Students learn advanced skills and sharpen their debate abilities in various styles and formats while learning in-depth issues.&nbsp;</font></p><p><font color="#424242">We train students in the following debate formats:</font></p><h5><font color="#424242">Canadian Debate Formats</font></h5><p><font color="#424242">- Canadian National Debate (CNDF)&nbsp;</font></p><p><font color="#424242">- Cross-Examination</font></p><p><font color="#424242">- Parliamentary Style</font></p><h5><font color="#424242">US Debate Formats</font></h5><p><font color="#424242">- Public Forum</font></p><p><font color="#424242">- Policy Debate</font></p><h5><font color="#424242">International Debate Formats</font></h5><p><font color="#424242">- World Schools&nbsp;</font></p><p><font color="#424242">-&nbsp;British Parliamentary</font></p><h6><font color="#424242">Private and Group classes available&nbsp;</font></h6>', 0, '2022-06-14 10:36:02', '2022-07-14 07:33:36');
