INSERT INTO `early_learning` (`id`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Early Learning | Ages three to six', '<p><font color="#424242">Enrich your childs playtime with fun and educational activities at Opus Academy! Pre-school learning is integral to a childs school success. Our Early Learning program promotes academic development and school readiness in an encouraging and fun environment focused on preparing them for grade school and encouraging an enthusiasm for lifelong learning. We believe in combining active play with structured educational activities, placing emphasis on language arts, reading readiness through phonics, as well as speaking skills, math, and printing. Your child will learn how to look at books, love them, and recognize how printed words convey meaning.</font></p><p><font color="#424242"><br></font></p><h5><font color="#424242">The Early Learning Speech Syllabus of the London College of Music</font></h5><p><font color="#424242">This program is designed to encourage young students with their speech abilities and assess their talents at early stages of development. The goal is to expand young childrens interactive oral communication skills and confidence. These courses are available in both individual private classes or group settings.</font></p><p><br></p>', 0, '2022-06-02 13:45:16', '2022-07-12 08:45:50');

