INSERT INTO `history` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'History and our Team', '<span open="" sans",="" sans-serif;"="" style="color: rgb(66, 66, 66);">Our team has over 200 years of combined knowledge and teaching experience. Our educational leaders, teachers, counsellors &amp; administrators are professionals working towards a common goalto develop the potential of every student. They hold masters and doctorate degrees, as well as other teaching credentials and many years of experience. By offering the best teachers, counsellors and administrators to work side by side with every student, we enable the student to reach his or her potential.</span><br open="" sans",="" sans-serif;"="" style="color: rgb(66, 66, 66);"><br open="" sans",="" sans-serif;"="" style="color: rgb(66, 66, 66);"><span open="" sans",="" sans-serif;"="" style="color: rgb(66, 66, 66);">Since opening our doors in 2002, we have helped thousands of students in their after-school enrichment education needs. Over the years, we have expanded our programs and services to meet the growing needs of our students. Through early preparation at Opus, many students have been admitted to highly selective universities, have embarked on fulfilling careers and even gained leadership positions in their chosen field.</span><span style="color: rgb(66, 66, 66);"></span><br>', 0, '2022-05-13 13:23:27', '2022-07-08 08:36:29');

