-- Dumping data for table opus.mcgraw_hill_education: ~4 rows (approximately)
INSERT INTO `mcgraw_hill_education` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Academic Enrichment', '<h5><font color="#424242">Programs</font></h5><h5><span style="font-size: 14px;"><font color="#424242">Stimulating &amp; Comprehensive Curricular</font></span></h5><h5></h5><h6><font color="#424242">From our range of innovative course offerings, we are proud to be able to offer exactly what your child needs for a complete after-school enrichment education program.</font></h6><h6><font color="#424242"><br></font></h6><h6><font color="#424242"><u>Customised curriculum</u></font></h6><h6><font color="#424242"><br></font></h6><h6><font color="#424242">At Opus, our expert teachers work from specialise&nbsp;curriculum\'s&nbsp;that facilitate the development of creative and critical thinking skills. Our multifaceted programs are intellectually demanding and flexible enough to accommodate every learning style.<br></font></h6><font color="#424242"><br></font>', 0, '2022-06-13 16:15:47', '2022-07-11 03:51:08'),
	(2, 'Section II', 'McGraw- Hill Education', '<ul style="padding-left: 2rem;"><li><font color="#424242">Digital Education Developed by Stanford University</font></li><ul style="padding-left: 2rem;"><li><font color="#424242">Redbird Mathematics from K-7</font></li><li><font color="#424242">Language Arts and Writing from Grade 2-7</font></li></ul><li><font color="#424242">Assessment and Learning in Knowledge Spaces (ALEKS) Mathematics Gr 6 to 12</font></li></ul><p><font color="#424242">We proudly offer Mathematics, Language Arts &amp; Writing courses developed by Stanford University through our relationship with McGraw-Hill Education. Formerly known as the Stanford University Education Program for Gifted Youth Program, the Redbird Mathematics Program, and the Redbird Language Arts and Writing Program are now under the McGraw Hill Education suite of courses. Additionally, McGraw Hill Education offers Assessment and LEarning in Knowledge Spaces (ALEKS) which is a groundbreaking web-based, artificially intelligent assessment and learning system in all levels of mathematics and certain Advanced Placement courses.</font></p><p><font color="#424242">The McGraw Hill Education courses combine advanced education technology based on cutting-edge educational research. The uniquely devised courses aim to present gifted students with the opportunity to learn according to their ability. The material is individualized and accommodates differences in student learning levels, allowing students to progress at their own pace and accelerate their education.</font></p><p><font color="#424242">At Opus Academy, we combine the McGraw Hill Education multimedia computer-based learning with face-to face instruction delivered by our qualified teachers. The classrooms provide students with a live forum in which they can interact with instructors and other students, and our small group environment allows for more individualized attention. Our instructors supplement the Redbird &amp; ALEKS curriculum with Opus enhancement activities to fulfill the academic needs of each student who enters our academy.</font></p>', 0, '2022-06-13 16:16:17', '2022-07-08 08:01:31'),
	(3, 'Section III', 'Redbird Mathematics K-7', '<h5 style=""><font color="#424242">Digital Education developed by Stanford University</font></h5><p><font color="#424242">A revolutionary learning model developed for the digital age<br style=""><br style=""></font></p><p style=""><font color="#424242">STEM (Science Technology, Engineering & Math) Themes and Projects</font></p><p style=""><font color="#424242">Redbird Mathematics is a K-7 adaptive mathematics curriculum developed after more than 20 years of research at Stanford University. Backed by proven results, this program features the latest in adaptive instruction, gamification and digital project-based learning.</font></p><p style=""><font color="#424242">Redbird Mathematics challenges students with unique and rigorous STEM projects and is designed to engage students with fun learning activities and games which are unlocked as they advance in each unit. Through Redbirds personalizes learning algorithms, each students account is automatically assessed and adapted based on activity proficiency Furthermore, it prepares students with a strong foundation preparing them for Algebra.</font></p><p style=""><font color="#424242">Redbird is guided by research and collaboration with:</font></p><p><span style="background-color: transparent;"><font color="#ffffff"><span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">Stanford Graduate School of Education</span><span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">Stanford department of Mathematics</span><span class="list bg-primary" style="--bs-bg-opacity:1; padding-left: 5px; padding-right: 5px; padding-bottom: 1px; border-radius: 3px;">Stanford Center for the study of Language and Information</span></font><br style=""><br style=""></span><a href="https://www.mheducation.com/prek-12/explore/redbird/redbird-mathematics.html" target="_blank">https://www.mheducation.com/prek-12/explore/redbird/redbird-mathematics.html</a><span style="background-color: transparent;"><a href="https://www.mheducation.com/prek-12/explore/redbird/redbird-mathematics.html" target="_blank" style="color: rgb(66, 66, 66);"></a></span></p><p><br></p><p style="text-align: center;"><iframe width="1280" height="720" src="https://www.youtube.com/embed/EhlyYnNst74" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe><br></p><table class="table" style="caption-side: bottom; --bs-table-bg:transparent; --bs-table-accent-bg:transparent; --bs-table-striped-color:#212529; --bs-table-striped-bg:rgba(0, 0, 0, 0.05); --bs-table-active-color:#212529; --bs-table-active-bg:rgba(0, 0, 0, 0.1); --bs-table-hover-color:#212529; --bs-table-hover-bg:rgba(0, 0, 0, 0.075); width: 1296.01px; color: rgb(33, 37, 41); vertical-align: top; border-color: rgb(222, 226, 230); font-family: " open="" sans",="" sans-serif;"=""><thead style="border-style: solid; border-width: 0px; vertical-align: bottom;"><tr style="border-style: solid; border-width: 0px;"><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">UNDERSTAND</th><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">APPLY</th><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">CREATE Design/Code/Simulate</th></tr></thead><tbody style="border-width: 2px 0px 0px; border-style: solid; border-top-color: currentcolor; vertical-align: inherit;"><tr style="border-style: solid; border-width: 0px;"><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Use multiple instructional modalities to achieve deep understanding of math content.</td><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Facilitates the application of math through rigorous practice and advanced games.</td><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Synthesizes math learnings to solve real-world projects using STEM tools.</td></tr></tbody></table><p style=""><font color="#424242">Our K6 personalized learning program is designed to meet the requirements of national and state math standards.</font></p><ul style="padding-left: 2rem;"><li><font color="#424242">Focus is achieved through an emphasis on major criteria.</font></li><li><font color="#424242">Coherence is developed by illuminating connections between concepts and utilizing mathematical structure.</font></li><li><font color="#424242">The three components of rigorconceptual understanding, procedural skill and fluency, and applicationsare integrated into the learning experience.</font></li></ul><p style=""><font color="#424242">Mathematical understanding is developed through initial instruction and solidified through problem-solving. Procedural skill initiates with instruction and fluency are achieved through plenty of practice, including engaging, on- going games. Applications appear throughout courses in the form of contextualized problems and STEM projects.</font></p><p style=""><font color="#424242">Additionally, rich STEM projects, career pathways, and contextualized problems inspire students to develop a love of mathematics and its applicable connection to the world at large.</font></p>', 0, '2022-06-13 16:16:26', '2022-07-11 04:01:36'),
	(4, 'Section IV', 'Redbird Language Arts & Writing 2-7', '<h5 style=""><font color="#424242">Digital Education developed by Stanford University</font></h5><p style=""><font color="#424242">Redbird Language Arts &amp; Writing is a digitally adaptive and personalized learning solution that helps students achieve their full potential as developing writers. Redbird technology is built upon more than 25 years of research in adaptive and writing tactics, addressing language, and writing standards for grades 27.</font></p><p style="text-align: center; "><font color="#424242"><iframe width="1280" height="720" src="https://www.youtube.com/embed/5IisoiWfIiU" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe><br></font></p><p style=""><font color="#424242"><a href="https://www.mheducation.com/prek-12/explore/redbird/language-arts-writing.html" style="">https://www.mheducation.com/prek-12/explore/redbird/language-arts-writing.html</a><br></font></p><p style=""><font color="#424242">Redbird Language Arts &amp; Writing combines a proven blend of instruction, interactive practice, and innovative writing analysis that enables students to build strong foundational writing skills. It is supported by an on-going partnership with researchers at the Stanford Center for the Study of Language and Information.</font></p><h5 style=""><font color="#424242">Why it works?</font></h5><p style=""><font color="#424242">Redbird Language Arts &amp; Writing leverages adaptive technology and a student-cantered, personalised&nbsp;learning model to tailor instruction, accelerate learning, and empower every student to take charge of their learning. It uses groundbreaking writing analysis technology to provide students with immediate, error-specific feedback on their sentence and paragraph composition, keeping them actively engaged, writing more, and continuously improving.</font></p><h5 style=""><font color="#424242">Redbird Language Arts &amp; Writing benefits both educators and students because it:</font></h5><p style=""><font color="#424242"><br></font></p><ul class="list-group list-group-shade" style="border-radius: 0.25rem;"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Complements core ELA instruction by&nbsp;providing adaptive, digital instruction, practice, and application in grammar, usage, and writing.</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Provides students with a richly personalised&nbsp;path through the curriculum, delivering precisely what each student needs to accelerate their learning.</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Integrates groundbreaking writing analysis technology, allowing students to receive error-specific instructional feedback on sentence and paragraph compositions.</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Empowers educators by freeing them from instructing and grading basic grammar and mechanics lessons, creating instructional time to focus on sophisticated aspects of writing that will truly boost student writing capabilities.</font></li></ul><p style="padding: 0.5rem 1rem;"><font color="#424242"><br></font></p><table class="table" style="caption-side: bottom; --bs-table-bg:transparent; --bs-table-accent-bg:transparent; --bs-table-striped-color:#212529; --bs-table-striped-bg:rgba(0, 0, 0, 0.05); --bs-table-active-color:#212529; --bs-table-active-bg:rgba(0, 0, 0, 0.1); --bs-table-hover-color:#212529; --bs-table-hover-bg:rgba(0, 0, 0, 0.075); width: 1296.01px; color: rgb(33, 37, 41); vertical-align: top; border-color: rgb(222, 226, 230); font-family: " open="" sans",="" sans-serif;"=""><thead style="border-style: solid; border-width: 0px; vertical-align: bottom;"><tr style="border-style: solid; border-width: 0px;"><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">UNDERSTAND</th><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">APPLY</th><th style="border-color: inherit; border-right-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">CREATE Design/Code/Simulate</th></tr></thead><tbody style="border-width: 2px 0px 0px; border-style: solid; border-top-color: currentcolor; vertical-align: inherit;"><tr style="border-style: solid; border-width: 0px;"><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Use multiple instructional modalities to achieve deep understanding of math content.</td><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Facilitates the application of math through rigorous practice and advanced games.</td><td style="border-color: inherit; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-width: 0px 0px 1px; padding: 0.5rem; background-color: var(--bs-table-bg); box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);">Synthesizers math learnings to solve real-world projects using STEM tools.</td></tr></tbody></table>', 0, '2022-06-13 16:16:30', '2022-06-14 05:20:15'),
	(5, 'Section V', 'Assessment and LEarning in Knowledge Spaces (ALEKS)', '<p><font color="#424242">Assessment and Learning&nbsp;in Knowledge Spaces (ALEKS) is an adaptive, online math program that uses artificial intelligence and open response questioning to identify student strength and weaknesses. ALEKS instructs students on the topics they are most ready to learn. ALEKS periodically reassesses the student to ensure that topics learned are also retained. ALEKS courses offer complete topic coverage, offering future success in school and beyond.</font></p><p><font color="#424242">Courses include:</font></p><ul class="list-group list-group-shade" style="border-radius: 0.25rem;"><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS Gr 6-8</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS Beginning Algebra</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS Intermediate Algebra</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS Pre-Calculus</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS Trigonometry</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">ALEKS AP Statistics</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Mastery of SAT Math</font></li><li class="list-group-item" style="padding: 0.5rem 1rem;"><font color="#424242">Mastery of ACT Math</font></li></ul>', 0, '2022-06-13 16:16:34', '2022-07-08 08:01:42');

