-- Dumping data for table opus.standardized_test_preparation: ~0 rows (approximately)
INSERT INTO `standardized_test_preparation` (`id`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Opus Standardized Test Preparation', '<div class="row" open="" sans",="" sans-serif;"="" style="--bs-gutter-x:1.5rem; --bs-gutter-y:0; margin-right: calc(-0.5 * var(--bs-gutter-x)); margin-left: calc(-0.5 * var(--bs-gutter-x)); color: rgb(49, 48, 48); font-family: "><div class="col-lg-4 col-sm-12" style="flex-basis: auto; width: 440px; max-width: 100%; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem; color: rgb(8, 66, 152); background-color: rgb(207, 226, 255);">Elementary &amp; High School Entrance Exams</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">SSAT, ISEE</li></ul></div><div class="col-lg-4 col-sm-12" style="flex-basis: auto; width: 440px; max-width: 100%; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem; color: rgb(8, 66, 152); background-color: rgb(207, 226, 255);">College Entrance Exams</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">SAT, ACT, TOEFL, IELTS</li></ul></div><div class="col-lg-4 col-sm-12" style="flex-basis: auto; width: 440px; max-width: 100%; padding-right: calc(var(--bs-gutter-x) * 0.5); padding-left: calc(var(--bs-gutter-x) * 0.5); margin-top: var(--bs-gutter-y);"><ul class="list-group" style="border-radius: 0.25rem;"><li class="list-group-item list-group-item-primary" aria-current="true" style="padding: 0.5rem 1rem; color: rgb(8, 66, 152); background-color: rgb(207, 226, 255);">Advanced Learning</li><li class="list-group-item" style="padding: 0.5rem 1rem; color: rgb(33, 37, 41);">All subjects of the Advanced Placement (AP) exams,&nbsp; International Baccalaureate (IB) Tests</li></ul></div></div><h5 class="mt-5" style="font-family: Raleway, sans-serif; color: rgb(49, 48, 48);">Methods and Results</h5><p open="" sans",="" sans-serif;"="" style=""><font color="#313030">We encourage preparing students for a variety of exams, as the results can play a determining role in their futures. Our test preparation courses begin with a diagnostic exam and continues with the development of a plan which is customized according to the students individual needs. We track student progress throughout the length of the program and administer practice exams under simulated test conditions. Test reports are used to review and identify areas for further skill strengthening as well as suggestions on how to study efficiently. Our goal is twofold: to raise students test scores, but also to equip them with real, lasting critical reasoning skills.&nbsp;</font></p><p open="" sans",="" sans-serif;"="" style=""><font color="#313030">The test-taking strategies and skills learned benefit students throughout their academic journey.&nbsp;</font></p>', 0, '2022-06-03 00:00:00', '2022-07-12 07:52:10');

