INSERT INTO `summer_camps` (`id`, `section`, `title`, `content`, `status`, `date_added`, `date_update`) VALUES
	(1, 'Section I', 'Summer Camps', '<p><font color="#000000">Opus Academys Summer camps offer students a chance to get ahead in their education journey! Explore from a wide range of course offerings which are both fun and stimulating. Our compact schedules help parents provide their children with great summer learning opportunities, while accommodating family travel and activities. Our camps enable students to gain momentum in their studies and make rapid skill development in a short period of time.</font><br></p><p></p><div style="text-align: center;"><img src="data:image/jpeg;base64," data-filename="img-6.jpg" alt="" title="children-img" class="m-4" style="width: 985.99px; height: 657.689px;"></div>', 0, '2022-05-10 14:13:10', '2022-07-12 07:31:13'),
	(3, 'Section II', 'Summer Intensive Academic Programs', '<ul open="" sans",="" sans-serif;"="" style="padding-left: 2rem;"><li><font color="#424242">Public Speaking and Debate Camps</font></li><li><font color="#424242">Speech Arts and Drama</font></li><li><font color="#424242">Language Arts and Writing (Elementary)</font></li><li><font color="#424242">Critical Reading and Writing (Secondary)</font></li><li><font color="#424242">Accelerated Math (Elementary)</font></li><li><font color="#424242">Secondary Math</font></li><li><font color="#424242">Music Theory, Harmony, History, Analysis Courses</font></li><li><font color="#424242">RCM Speech Technical Theory, History &amp; Literature Exams</font></li><li><font color="#424242">Standardized Test Preparation- SAT, ACT, SSAT, ISEE, TOEFL, IELTS</font></li><li><font color="#424242">Pre-AP &amp; AP Intensive Courses</font></li><li><font color="#424242">Academic Subject Enrichment</font></li><li><font color="#424242">Business Courses for High School Students (Wharton High School Curriculum)</font></li><li><font color="#424242">Youth Leadership Training</font></li><li><font color="#424242">Etiquette for Kids &amp; Teens</font></li></ul>', 0, '2022-05-10 15:22:20', '2022-07-08 08:10:28');

