-- Dumping data for table opus.team: ~4 rows (approximately)
INSERT INTO `team` (`id`, `img`, `name`, `position`, `introduction`, `status`, `date_added`, `date_update`) VALUES
	(1, '../assets/img/team/team-5.jpg', 'Dr. Janette Lim', 'Founder', '&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;In 2002, Dr. Janette Lim founded Opus Academy stemming from her joy working with young people globally and her passion for inspiring students to maximize their potential.&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;She has extensive experience in education and non-education fields such as Insurance &amp;amp; Finance, Hospitality, and International Business. Over decades of working with immigrant and local families and in the corporate world, Dr. Lim observed overarching themes that emerge in business, education and global leadership - namely that the ability to communicate well, with a firm academic foundation and strong character, empower people to achieve their goals and be their best selves. Dr. Lims passion for helping young people acquire superior education led her to establish Opus Academy.&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;Dr. Janette Lim holds an Ed.D from Pepperdine University, MBA from Queens University (Canada) and M.Ed. from University of Calgary. In addition, she holds industry-specific designations which give her diverse knowledge and expertise. She is a Professional Member of the Independent Educational Consultant Association (IECA) and a member of National Association for College Admissions Counselling (NACAC).&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;&lt;div&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 404.455px; float: left; height: 124.573px; margin-right: 1%;&quot; data-filename=&quot;ncac.png&quot; class=&quot;note-float-left&quot; title=&quot;&quot;&gt;&amp;nbsp;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 398.106px; height: 122.573px; float: left;&quot; data-filename=&quot;f_bot_ban.png&quot; class=&quot;note-float-left&quot; title=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;', 0, '2022-05-16 10:02:35', '2022-07-11 01:02:02'),
	(2, '../assets/img/team/team-6.jpg', 'Alex Lims', 'Co-Founder and Music Director', '&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;Alex Lim is the co-founder and Music Director of Opus Academy. As a music teacher whose experience spans over thirty years, he has worked with many musically gifted students. Having worked with many immigrant families in Greater Vancouver, he also perceived the lack of comprehensive services in enrichment education and university counselling. He co-founded Opus Academy in the hope of helping more families and students to achieve their goals.&lt;/span&gt;&lt;br style=&quot;color: rgb(66, 66, 66);&quot;&gt;&lt;br style=&quot;color: rgb(66, 66, 66);&quot;&gt;&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;Alexs students have won numerous awards and scholarships - locally, nationally and internationally. He holds a B. Mus degree from the University of British Columbia, a member of the British Columbias Registered Music Teachers Association (BCRMTA) and National Association of College Admissions Counselling (NACAC).&lt;/span&gt;&lt;br&gt;', 0, '2022-05-16 10:02:45', '2022-07-08 08:26:36'),
	(3, '', 'Teachers', 'Teachers', '&lt;font color=&quot;#424242&quot;&gt;Our teachers motivate and inspire students. They have subject area expertise and are committed to students success. They guide students not only to understand but also to master foundational and advanced materials, equipping students with the skills necessary to succeed in school, college and beyond. Our teachers push students to achieve their personal best, academically and socially. Their goal is to expand the intellectual curiosity of each student while helping to develop character.&lt;/font&gt;', 0, '2022-05-16 10:03:00', '2022-07-11 00:37:27'),
	(4, '', 'University Counsellors', 'University Counsellors', '&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;Our counsellors are experienced and knowledgeable in the university admissions process, with a deep understanding of many universities and their offerings, as well as university applications, and the all-important personal essay. Our counsellors stay in touch with current trends and spend time touring campuses, talking with university counselling professionals and admission officers. They have the knowledge and tools to help students succeed in the university selection process.&lt;/span&gt;&lt;br&gt;', 0, '2022-05-16 10:03:08', '2022-07-11 00:36:44');

