INSERT INTO `testimonials` (`id`, `name`, `position`, `content`, `category`, `sort`, `status`, `date_added`, `date_update`) VALUES
	(1, 'David Yang', '', '&lt;font color=&quot;#424242&quot;&gt;The university counselling program offered by Opus is second to none, and the numerous valuable tips and insights given by the counsellors and teachers have made my university admissions process less stressful and much straighter forward for me to figure out.&amp;nbsp; The help I got from the chemistry teacher helped me ace my science courses at school; and working with the history teachers has helped me win numerous social science and humanities competitions.&amp;nbsp; The counselling team at Opus was instrumental in getting me to where I am today; Rice University.&amp;nbsp; Thank you!&lt;/font&gt;', 'Counselling - University Page', 0, 0, '2022-07-13 15:24:48', '2022-07-13 07:27:51'),
	(2, 'Kelly Kong', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Coming to Opus really helped me develop my time management and other skills that are useful to not only university but also life.&amp;nbsp; Im glad that I came because after taking several courses here, I became more motivated to learn for myself.&amp;nbsp; &amp;nbsp;Thanks to you guys (Joby Chen) I got in to a university that Ive always wanted to go to:&amp;nbsp; Parsons.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-13 15:28:38', '2022-07-13 07:28:38'),
	(3, 'Connie Guo', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;As the Chinese proverb goes, it takes a village to raise a child. Fortunately, I received so much help from the entire Opus team throughout my university application process. I had no clear direction nor confidence when I first came to Opus in grade 11. It was through the countless sessions spent with the teachers and relentless editing that my application package and essays were perfected; in fact, the guidance of the teachers also made me a much better writer. When I opened my acceptance email by UCLA, USC, NYU and so many other colleges I did not even expect to get in, I was astonished. Thank you to all the teachers---you made me realize my potentials.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-13 15:29:12', '2022-07-13 07:29:12'),
	(4, 'Nicole (Connie Guos mom)', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Applying for a US university is much more complicated and competitive than applying for a Canadian university. From SAT tests preparation, AP courses, and common application essays to extracurricular activities... The amount of work is huge and often intimidating. Looking back my daughters entire process of applying for a US university, I feel very fortunate to have the help of an excellent team like OPUS Academy.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;OPUS teachers and counsellors have extremely rich experience in both subject and counselling areas, and their professional level is definitely the best in the industry. I was deeply impressed by the thoroughness, accuracy and dedication of their work. Every member of the OPUS team, from the administrative staff to the teachers, treats the client with sincerity and professionalism. I want to thank counsellor/teacher Joby for guiding my daughter every step of the way through her application process; and the front desk staff, Caroline in particular, for making my daughter always felt welcomed and cared for with their kindness and helpfulness. As a result, my daughter received admission letters from UCLA, USC, and NYU, which she had dreamed for but was intimidated to apply before getting help from Opus.&lt;/font&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-13 15:29:52', '2022-07-13 07:29:52'),
	(5, 'Olivia Xiao', '(Sophia and Martin Zous mom)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;font face=&quot;inherit, serif&quot; color=&quot;#424242&quot;&gt;During the process of my daughter and son applications for a private school process. Opus provided the guidance and assistance we needed. The counsellors at Opus gave the most helpful counselling advises to me and my husband in choosing a private school. Our counsellor helped us with filling out the registration forms, guided us through each stage of the application. He also helped us with email and written correspondence. Both my son and daughter are now in a well-known private school in Vancouver. Thank you, Opus!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - Private School Page', 0, 0, '2022-07-13 15:30:34', '2022-07-13 07:30:34'),
	(6, 'Vincent Lin', 'Jessica Lins Dad', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My daughter Jessica, after taking the SSAT preparation course and Interview Skills training course, was successfully admitted to the Crofton House School when she entered Grade 8. Thank you Opus for your help! Opus not only has the best teachers in the industry, but also the entire professional team that provides efficient and caring customer services.&amp;nbsp; Opus is the most professional and experienced organization in training and consulting I have worked with. Opus is the best!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - Private School Page', 0, 0, '2022-07-13 15:31:18', '2022-07-13 07:31:18'),
	(7, 'Jason Li', 'Bradley Lis Father', '&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-justify:inter-ideograph;\nmso-pagination:none&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;The interview skills course was a great class for my son. It provides essential information and guidelines on how to prepare for an interview when applying for a private school. My son enjoyed the class and learned many interview skills from instructor and all other staffs.&amp;nbsp;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Opus Academy offers a wide variety of courses for students in all levels and always provides suggestions and recommends the specific course for different students with their own needs.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', 'Interview Skills Courses', 0, 0, '2022-07-13 15:32:02', '2022-07-13 07:32:02'),
	(8, 'Olivia Xiao', '(Sophia and Martin Zous mom)', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;I am strongly convinced that the Interview Skills training course at Opus Academy played a very important role in my childrens admissions to a private school. Both my son and daughter have greatly enjoyed and benefited from the course. The teachers at Opus Academy are fantastic, helpful and professional. The course was very well designed, fun, interactive and very relevant.&amp;nbsp; My children like it very much. The kids were relaxed, confident and well behaved during their interviews, as a result. Thank you very much!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Interview Skills Courses', 0, 0, '2022-07-13 15:34:17', '2022-07-13 07:34:17'),
	(10, 'Victoria Cai', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My daughter was successfully admitted to the Crofton House School last fall. My special thanks go to Opus Academy for the Interview Skills training course. This course is highly target-oriented, and covers a wide range of content, from how to make an eye contact and shake hands to how to answer the interviewers questions with ease and calmness. It teaches children confidence, adaptability and flexibility.&amp;nbsp; The teachers at Opus are kind, patient and very professional. They design their lesson plans based on a childs needs. I would strongly recommend this course to children who want to get into a prestigious school.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Interview Skills Courses', 0, 0, '2022-07-13 15:42:04', '2022-07-13 08:34:29'),
	(11, 'Sophia', 'Jing Jiangs Mother ', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My son has been taking English Reading and Speech and Drama courses at Opus Academy since October 2014. He enjoys to come to classes at Opus and has made great progress. In January 2015, he applied for St. Georges School and took the entrance exam. He successfully passed the exam and was admitted to the school. The teaching methods at Opus Academy are very distinctive, which stimulate childrens love of learning and cultivate good study habits. Thanks to the Opus Academy for teaching and mentoring my son for the past eight months!&amp;nbsp;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Interview Skills Courses', 0, 0, '2022-07-13 15:42:50', '2022-07-13 07:42:50'),
	(12, 'David Yang', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Opus Academy has given me all the study skills, and the teachers who taught me AP courses have all made direct impact on my early acceptance to a top college in the States. Thank you!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'AP Courses', 0, 0, '2022-07-13 15:43:18', '2022-07-13 07:43:18'),
	(13, 'N/A', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My daughter used to be shy. When she was in Kindergarten we put her in a class of Speech &amp;amp; Drama for Little Learners at Opus Academy. The class taught her phonics, stories and poems. The teacher would get kids to do show-and-tells, movements and mimes. Since then she has become very cheerful and confident. Thanks to Opus for the wonderful program.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Early learners', 0, 0, '2022-07-13 15:43:45', '2022-07-13 07:43:45'),
	(14, 'Vanessa', 'Speech Arts Student, Grade 11', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;&amp;nbsp;This course has not only helped me in my speech practical exams, but my school work as well.&amp;nbsp; Reading through plays and talking about literary works has&amp;nbsp; helped me understand references in school that are foreign to most people.&amp;nbsp; It also gave me more to write about in essays because I can draw on examples from literature I have read.&amp;nbsp; Often, the works that I study in RCM Speech Arts History and Literature courses I use in school as well.&amp;nbsp; The course is good for academic purposes, and in everyday life: it helps me understand references and allusions.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Although the course is a lot of work, it is definitely worth it.&amp;nbsp; There is a lot to read and understand, but it is taught in such a way that you have a greater understanding of history by the end.&amp;nbsp; All the literary works have historical and political significance.&amp;nbsp; Also, you gain an understanding of how to read and analyze works of literature beyond the ones you read in class.&lt;/font&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:54:51', '2022-07-13 23:54:51'),
	(15, 'Jason', 'Gr. 9 Speech Arts student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;I particularly enjoyed the intellectual and depth of thought employed in the classes. Indeed, the discussions surrounding literature and the historical context of the pieces added another layer of understanding not only to the course, but also to school and general knowledge as well. Coming out of the course meant not only a certificate from LCM/RCM/TG, but also a deeper appreciation for literature as well.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:55:31', '2022-07-13 23:55:31'),
	(16, 'Stacy', 'Speech Arts Student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Overall I have learned so much from the Grade 10 speech arts course.&amp;nbsp; I gained a lot of confidence through this course.&amp;nbsp; All the background research and extensive rehearsal we did in class really gave me confidence performing. This course has also taught me the importance of time management and how to be efficient with my work, since I had to spread out my memorization over a span of many weeks.&amp;nbsp; All the skills I have learned from the course may will serve me well in the future.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:55:56', '2022-07-13 23:55:56'),
	(17, 'Brian', 'Gr.10 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The way my teacher taught the course made studying easier because I remembered things from the beginning of the course. We managed time wisely and finished the course on time. My teacher was very concise and to-the-point, as well as knowledgeable  I learned something new each time. The teacher always made sure I understood the topic before moving on, and gave good notes which were easy to refer to later. The course helps me in English at school, improving my ability to analyze and understand plays and poems. I have a better sense of English literature and language that will in turn help me in public speaking.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:56:18', '2022-07-13 23:56:18'),
	(18, 'Andrew', 'Gr. 6 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Taking the RCM Speech Arts Theory Level 1 course has allowed me to move ahead in school and strive in other courses. When the material from this course is taught in school, I can easily recall what was taught in the course and further expand my knowledge of this material. Also, I am sure that the History and Literature course will help in the same way when our school begins teaching the material. Many courses at Opus Academy have allowed me to be ahead of what is being taught at school.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:56:43', '2022-07-13 23:56:43'),
	(19, 'Natasha', 'Gr. 9 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The RCM Speech Arts History and Literature and Technical Theory lessons are very good.&amp;nbsp; Not only do they help me in school with subjects like socials studies (history), but they allow me to obtain very high marks on the RCM examinations.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:57:07', '2022-07-13 23:57:07'),
	(20, 'Oscar', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The Opus Speech Arts and Drama Program may be one of the best programs that one could ever take.&amp;nbsp; Speech Arts has helped me not only in my speaking, it has changed who I am, how I perceive the world, and how I act in front of people.&amp;nbsp; Before I took the program, I was always horrified to speak to strangers, even my fellow students I didnt know. If I had to speak to people, my voice would always be so low that people couldnt even hear. But now, after three and half years of Speech Arts training, I was nearly voted the person in Grade 10 who did not need megaphone! Not only did the Speech Arts program help me get confidence in my speaking, it has also helped me to be one of the top three students in my English class. I still remember the look on my classmates faces when we first began reading Romeo and Juliet, how they were as pale as snow when the teacher announced that we would have to act out Shakespeare in front of the class-but not me!&amp;nbsp; Doing speech arts for so long had prepared me for all this, and I was the only one smiling and joking around about it in my class. I am not exaggerating, they become so jealous and all tried to have me in their Shakespeare scene.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The theory and the history associated with speech arts also helped me very much in my school life.&amp;nbsp; Thanks to the history courses for speech arts, I can understand easily what the teacher is talking about when it comes to poetry and plays-so much so that I was called by a teacher our class resident poet. Thanks to the theory I learned and my experience in speech arts, I was voted vice-president of my schools Toastmasters Club. Taking the speech theory course at Opus aided me in my campaign, since I was able to adapt what I learned in Opus and teach it to my fellow club members. No matter how I look at it, speech arts at Opus has changed my life and help me be more active in my school community.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The staff and teachers at Opus are very kind and encouraging.&amp;nbsp; They are funny, thoughtful, but also serious when it is demanded.&amp;nbsp; They are excellent people to work with.&amp;nbsp; The facility is also top rated.&amp;nbsp; It is clean, well furnished, and large enough to do what needs to be done. Overall an excellent place to study and learn.&lt;/font&gt;&lt;/p&gt;', 'Speech and Drama', 0, 0, '2022-07-14 07:57:34', '2022-07-13 23:57:34'),
	(21, 'Alvin', 'Math student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The math program at Opus is great, developing skills from basic math all the way to calculus. The EPGY program from Stanford is highly developed and the teachers are very knowledgeable.&amp;nbsp; I would highly recommend the math teachers at Opus Academy. The instructors are great and there is a wide variety of areas to pursue.&amp;nbsp; From speech and drama to math and English, Opus offers the best in enrichment for students.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Math', 0, 0, '2022-07-14 08:03:29', '2022-07-14 00:03:29'),
	(22, 'Michael', 'Math Student, Grade 8', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The system used for the mathematics program at Opus Academy is very unique. The majority of the lectures and assignments are provided by a computer, rather than a teacher in person. I prefer this system, especially since a teacher is able to help me if I am stuck on a question. The lectures are detailed and cover most of the concepts for the chapters. The additional help from the math teacher is convenient. Thanks to this magnificent learning program, I was able to further develop my mathematical skills. If you consider putting your son/daughter in an educational academy, I highly recommend Opus Academy.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Math', 0, 0, '2022-07-14 08:03:57', '2022-07-14 00:03:57'),
	(23, 'Angela', 'Gr. 7 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Our teacher always gives us many fun assignments and a fair amount of homework. She is very humorous, and when we are on the computer, she helps us if we get stuck. Our teacher is always happy and makes the class fun, helping us with different types of writing styles.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English -  Elementary', 0, 0, '2022-07-14 08:10:32', '2022-07-14 00:10:32'),
	(24, 'Jacqueline', 'Gr. 6 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Opus really helped me improve my grammar skills, language arts skills, and speech art/drama skills. It also really motivated me to try to read different genres. I am very glad I took the courses. I really enjoyed working with both of my teachers, and I hope I get to work with them again.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English -  Elementary', 0, 0, '2022-07-14 08:11:19', '2022-07-14 00:11:19'),
	(25, 'Jason ', 'Gr. 9 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Three years stuck in the same course has definitely helped me bond with the writing course which has dominated my Sundays. However, the levels of writing, analysis, rhetoric, and much more learnt in the course has helped me so much in both my school career and interpersonal interactions. Communication through writing, the main focus of the course, has definitely become a skill at which I excel and am comfortable with.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English - Secondary Level', 0, 0, '2022-07-14 08:11:47', '2022-07-14 00:11:47'),
	(26, 'Melody', 'English Writing Student, Grade 11', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;I have been taking the English Writing series of courses ever since I started coming to Opus Academy. This course has really helped me become a strong English student at school. I have learned many different writing styles and techniques which I have found useful for the various writing assignments I receive at school. Not only have I improved my writing skills, but also my reading and analysis skills. I have read many interesting articles, short stories, and novels, reading which increased my range of knowledge. This course was really worth taking.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English - Secondary Level', 0, 0, '2022-07-14 08:12:09', '2022-07-14 00:12:09'),
	(27, 'Margaret', 'EPGY English Writing Student, Grade 12', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Through Opus EPGY Program, I was able to gain experience in essay writing and develop fundamental writing skills. I read various literary works, including Arthur Millers The Crucible, and I learned how to recognize and avoid logical fallacies and improve my writing techniques. These skills proved invaluable at school, especially in expository essay writing, literary essay writing and persuasive essay writing. With the help of my writing teacher, I can now approach writing assignments with confidence.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English - Secondary Level', 0, 0, '2022-07-14 08:12:34', '2022-07-14 00:12:34'),
	(28, 'Jeffrey', 'Gr 12 student IB', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My English teacher Anne is one of the best teachers I have ever met.&amp;nbsp; She is extremely talented at literary analysis, providing a very structural and methodical way of examining: content, style, diction and theme. Her specific instructions and insights into effective reading and writing I found lacking even in International Baccalaureate programs and other literary courses have all been Annes specialty. Although the study of literature can be tedious and often boring with other instructors, Anne brings ones understanding of text and content to a deeper, more emotional level that students can honestly connect with. I would recommend her to IB, AP and university students who are having trouble finding a personal understanding of literature.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English - Secondary Level', 0, 0, '2022-07-14 08:13:13', '2022-07-14 00:13:13'),
	(29, 'Ava', 'Gr. 11 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The course was great and the teacher was very friendly and open.&amp;nbsp; The amount of work was just right and the course ran smoothly. I enjoyed the small class size and thought the overall course was fantastic!&amp;nbsp; All material that we learned was very helpful and it has helped me improve in my school work. Opus has a great learning environment and all the staff and teachers are super nice.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'English - Secondary Level', 0, 0, '2022-07-14 08:13:41', '2022-07-14 00:13:41'),
	(30, 'Jason', 'Gr. 9 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Though unrelated to anything at school or anything I had ever come in contact with, the AP Psychology class which I attended was especially an influence in helping me comprehend the beauty of nature and the mind.&amp;nbsp; The class helped me understand the world in a new way, and is an experience which I will always cherish.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'AP Courses', 0, 0, '2022-07-14 08:14:09', '2022-07-14 00:14:09'),
	(31, 'Natasha', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Opus Academy was the place that first taught me to express myself boldly and creatively. Naturally, I turned to Opus when it came to that crucial point in my life when I was applying to universities. I wouldnt be where I am without Opus university counselling program to guide me. The process itself was long and strenuous, but Opus was there to show me exactly what I needed to do to present myself with integrity and flair to the universities of my choice. To say I am satisfied with Opus university counselling program would be an understatement. My mentors were intelligent about the process, and dedicated a great deal of time to helping out an inexperienced student. I am excited to be embarking on the next great journey in my life -- university -- and am firmly convinced I wouldnt be where I am without Opus by my side.&amp;nbsp;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-14 08:14:35', '2022-07-14 00:14:35'),
	(32, 'David', '', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;&amp;nbsp;Opus Academy has given me all the skills and teachers that have made direct impacts on my early acceptance to Rice University.&amp;nbsp; Working with the history teachers has helped me win numerous social science and humanities competitions.&amp;nbsp; Also, receiving help from the chemistry teachers has helped me ace my science courses at school. Lastly, the university counselling program offered by Opus is second to none, and the numerous valuable tips and insights given by the advisors has made the university admissions process less stressful and simpler for me to figure out. The faculty at Opus were instrumental in getting me to where I am today. Thank you!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-14 08:15:02', '2022-07-14 00:15:02'),
	(33, 'Kathy', 'Gr. 12 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;I am a graduating Grade 12 student from Kitsilano Secondary School and I got accepted to Cornell University, UIUC, etc. I got a lot of help from Opus teachers during my university preparation process. Michael helped me with SAT prep and Amanda helped me with interview prep.&amp;nbsp; I also took public speaking with Guy in Grade 10.&amp;nbsp; I found all the teachers here responsible, and the knowledge and strategies I obtained here really helped me build up confidence. I really appreciated their caring teaching.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - University Page', 0, 0, '2022-07-14 08:20:30', '2022-07-14 00:20:30'),
	(34, 'Jessica Lin', 'Grade 7', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Opus Academys courses and teachers have helped me in many ways. I took Opus English SSAT course, as well as the interview skill course. The English SSAT course allowed me to achieve a high score in the SSAT, especially in English, one of my weaker areas. I also found Opus interview course very useful. It increased my confidence during interviews. My public speaking skills and social etiquette were greatly improved. What I learned during this course will be used throughout the course of my life. Opus Academys amazing courses and helpful teachers have helped me greatly in a short period of time, and even allowed me to get into my high schools of choice.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - Private School Page', 0, 0, '2022-07-14 08:20:55', '2022-07-14 00:20:55'),
	(35, 'Katy', '(Grade 7)', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My name is Katy Lee and I just started attending a boarding school called Rectory School in the United States. I am really enjoying my life there, and now when I look back, I think Opus helped me a lot with improving my English, expanding my vocabulary, improving my articulation, and encouraging me to get this far. I thank all the teachers who have taught me many important skills that I needed when preparing for something big, like applying to Rectory. I never thought these classes such as Current Events, Communication Skills, Speech Arts, or Interview Skills would ever help me, but I really learned a lot through these courses. For example, by taking Current Events class with Shane and Shannon (which was fun!) I learned to care more about what was going on in the world which I think that affected me very much in my history class. My Communication Skills, Speech Arts and Interview Skills helped me improve pronunciation, articulation, and get more comfortable and confident with public speaking, which I didnt really enjoy doing before. You need to know how to speak in public if you are to attend private boarding schools because the teachers there find it important; further, you need to learn how to behave in an interview in order to get into schools like Rectory or any other wonderful school.&amp;nbsp; I recommend that you take these classes. The teachers are fun, and you learn a lot!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Counselling - Private School Page', 0, 0, '2022-07-14 08:24:14', '2022-07-14 00:24:14'),
	(36, 'Annie', 'Parent', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My sons Opus Teacher has inspired my child and helped build his confidence in both speaking and social interaction.&amp;nbsp; She has great patience engaging young children and her teaching approach is very lively.&amp;nbsp; I greatly appreciate all the support Opus and its staff have provided.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Early learners', 0, 0, '2022-07-14 08:25:04', '2022-07-14 00:25:04'),
	(37, 'Patrick', 'Gr. 6 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;I have studied at Opus for five years. Opus Academy has helped me in writing, answering in full sentences, improving my speechwriting, and given me chances to perform my piano.&amp;nbsp; I thank all the staff and teachers who have taught me valuable skills to improve my grades.&amp;nbsp; The teachers at Opus are also very kind and understanding. Finally, I want to thank Opus Academy for helping me build up my confidence in performing. In these five years, I have learned to improve my writing, grammar, and piano.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'General', 0, 0, '2022-07-14 08:26:07', '2022-07-14 00:26:07'),
	(38, 'Jenny', 'Gr. 4 student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;Being here at Opus with my wonderful teacher was very helpful.&amp;nbsp; I got better grades in school tests and more confidence for when I speak to people I have not met before. The time I spent here was not wasted.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'General', 0, 0, '2022-07-14 08:26:33', '2022-07-14 00:26:33'),
	(39, 'David', 'Grade 8 Student', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;The courses that I took have been very productive and enjoyable. They have improved and reinforced my English and creative writing skills. They also broadened my vocabulary and improved my writing style for both my essays and poetry. The teachers here love what they do, teaching. The teachers at Opus love what they teach and are passionate about it.&amp;nbsp; I have taken other classes at Opus such as Speech &amp;amp; Drama, Language Arts and Writing, and Math.&amp;nbsp; The teachers at Opus are some of the best teachers Ive ever met.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'General', 0, 0, '2022-07-14 08:27:13', '2022-07-14 00:27:13'),
	(40, 'Judy', 'Parent', '&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-CA&quot; style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;font-family: Nunito;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;I\nfirst sent my two daughters to Opus Academy in 2004. Although I was initially\nunsure whether these speech, writing and math classes were worth the cost and\ntime required, I was soon convinced of the effectiveness of Opus Academys\nprograms. The teachers and staff are experienced and knowledgeable  not to\nmention helpful and supportive.&amp;nbsp;When the time came for my daughters to\napply for university, both the writing and speech programs were vital in preparing\nthem for applications and interviews.&amp;nbsp; I would strongly recommend Opus\nAcademy to prospective parents and students.&amp;nbsp;&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', 'Parent Testimonial', 0, 0, '2022-07-14 08:27:48', '2022-07-14 00:27:48'),
	(41, 'Joseph', 'Parent', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;We are very satisfied with Lyndons development and progress since he started the public speaking course with Opus.&amp;nbsp; We can see his confidence growing: the way he prepares a presentation is much improved and his presentation skills are much better.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Parent Testimonial', 0, 0, '2022-07-14 08:28:14', '2022-07-14 00:28:14'),
	(42, 'Katy Lees Mother', 'Parent', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;My daughter has been studying at Opus for about one year and ten months. Katy had previously studied English in Korea; however, I found significant differences between the classes in Korea and Opus. The first year at Opus, Katy did not show any great improvement. But now when I think about it, during that year all the different classes she took, especially EPGY courses, must have been gradually strengthening Katys weaknesses. The knowledge and the ambition that the teachers in Opus have seem comparable to that of university professors. Specifically, the teachers precise understanding of their students and the information they provide were beyond my expectations. Currently, the writing class that Katy once found to be most difficult has become her favourite subject. Also, Katys countless experiences on the stage during her speech class have helped her build confidence and skills. Katy is currently taking General Communication Arts, Current Events, and Essay Writing courses and she says that these classes are very helpful. Katy likes that she gets to choose the books and the topics to present to the class. Also, Katy feels proud that she is acquiring new vocabulary to expand her knowledge. The Current Events class is a great way for Katy to become involved in the world. She asks about my own opinions on certain events or incidents so that I also have to keep up with the current news issues. As a mother, I am so happy to see my daughter becoming a global citizen. I am so grateful to Opus.&quot;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Parent Testimonial', 0, 0, '2022-07-14 08:28:56', '2022-07-14 00:28:56'),
	(43, 'Grace', 'Parent', '&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;&quot;I remember how I was desperately looking for a good speech and math program one year ago for my grade six boy who was upset about his school performance after living overseas for nearly 11 years.&amp;nbsp; His new schoolteacher in a top Vancouver public school not only assigned him to an ESL class, even though his first language is English, but also commented that his math shows no basic comprehension. Luckily, after several months of desperately looking for remedial classes, we were recommended by an experienced English teacher to attend both Opus speech and EPGY math programs, which later assessed my sons math at a much higher level He is a much happier youth now because of his talented and patient EPGY math tutor, who knows how to challenge him and accelerate his math level over time. For his speech classes, we want to give special thanks to Shannon who has been so kind and so encouraging to my son that he even pushes us to continue his speech lessons forever. After taking classes with Shannon since last November, Geoffs oral presentation and debating skills are dramatically improved, which will help him to reach his personal goals and future career plans. I could not imagine how Geoff could change so much from a depressed student, nearly failing at school, to a confident and hopeful young man. Thank you, Shannon and Darren and Opus -- its because of Opus outstanding teaching staff that my child has become a good testimony to if you are willing, you can make it.&quot;&amp;nbsp;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'Parent Testimonial', 0, 0, '2022-07-14 08:29:25', '2022-07-14 00:29:25');

